va senha está sendo enviada para o endereço de e-mail registrado para \"$1\".\nPor favor, reconecte-se ao recebê-lo.\";'),('pt-br','messages:blocked-mailpassword','s:147:\"O seu endereço de IP foi bloqueado para editar. Para evitar abusos, não é permitido o uso de recuperação de senha a partir deste endereço IP.\";'),('pt-br','messages:eauthentsent','s:239:\"Uma mensagem de confirmação foi enviada para o endereço de e-mail fornecido.\nAntes de qualquer outro e-mail ser enviado para a sua conta, você precisará seguir as instruções da mensagem, de modo a confirmar que a conta é mesmo sua.\";'),('pt-br','messages:throttled-mailpassword','s:186:\"Um lembrete de senha já foi enviado {{PLURAL:$1|na última hora|nas últimas $1 horas}}.\nPara prevenir abusos, apenas um lembrete poderá ser enviado a cada {{PLURAL:$1|hora|$1 horas}}.\";'),('pt-br','messages:mailerror','s:25:\"Erro a enviar o email: $1\";'),('pt-br','messages:acct_creation_throttle_hit','s:275:\"Visitantes desta wiki com endereço IP igual ao seu criaram {{PLURAL:$1|uma conta|$1 contas}} nos últimos (ou últimas) $2, o que é o máximo permitido neste período de tempo.\nComo resultado, visitantes com este endereço IP não podem criar mais nenhuma conta no momento.\";'),('pt-br','messages:emailauthenticated','s:55:\"O seu endereço de e-mail foi autenticado às $3 de $2.\";'),('pt-br','messages:emailnotauthenticated','s:135:\"O seu endereço de e-mail ainda não foi autenticado.\nNão lhe será enviado nenhum e-mail sobre nenhuma das seguintes funcionalidades.\";'),('pt-br','messages:noemailprefs','s:76:\"Especifique um endereço de e-mail para que os seguintes recursos funcionem.\";'),('pt-br','messages:emailconfirmlink','s:34:\"Confirme o seu endereço de e-mail\";'),('pt-br','messages:invalidemailaddress','s:160:\"O endereço de \'\'e-mail\'\' não pode ser aceite devido a talvez possuir um formato inválido. Por favor, introduza um endereço bem formatado ou esvazie o campo.\";'),('pt-br','messages:cannotchangeemail','s:52:\"A conta de e-mail não pode ser alterada neste wiki.\";'),('pt-br','messages:emaildisabled','s:39:\"Este site não tem como enviar e-mails.\";'),('pt-br','messages:accountcreated','s:12:\"Conta criada\";'),('pt-br','messages:accountcreatedtext','s:89:\"A conta de usuário para [[{{ns:User}}:$1|$1]] ([[{{ns:User talk}}:$1|talk]]) foi criada.\";'),('pt-br','messages:createaccount-title','s:34:\"Criação de conta em {{SITENAME}}\";'),('pt-br','messages:createaccount-text','s:225:\"Alguém criou uma conta de nome $2 para o seu endereço de email no wiki {{SITENAME}} ($4), tendo como senha \"$3\".\nVocê deve se autenticar e alterar sua senha.\n\nIgnore esta mensagem caso a conta tenha sido criada por engano.\";'),('pt-br','messages:login-throttled','s:103:\"Você recentemente tentou iniciar sessão muitas vezes.\nPor favor aguarde $1 antes de tentar novamente.\";'),('pt-br','messages:login-abort-generic','s:48:\"A sua autenticação não teve êxito - Abortada\";'),('pt-br','messages:login-migrated-generic','s:76:\"A sua conta foi migrada e o seu nome de usuário já não existe nesta wiki.\";'),('pt-br','messages:loginlanguagelabel','s:10:\"Idioma: $1\";'),('pt-br','messages:suspicious-userlogout','s:135:\"Sua solicitação para sair foi negada porque aparentemente foi enviada por um navegador danificado ou por um servidor proxy com cache.\";'),('pt-br','messages:createacct-another-realname-tip','s:141:\"O nome verdadeiro é opcional.\nSe você optar por fornecê-lo, este nome será utilizado para dar ao usuário a atribuição de seu trabalho.\";'),('pt-br','messages:pt-login','s:6:\"Entrar\";'),('pt-br','messages:pt-login-button','s:6:\"Entrar\";'),('pt-br','messages:pt-login-continue-button','s:18:\"Continuar conexão\";'),('pt-br','messages:pt-createaccount','s:14:\"Crie uma conta\";'),('pt-br','messages:pt-userlogout','s:4:\"Sair\";'),('pt-br','messages:php-mail-error-unknown','s:43:\"Erro desconhecido na função mail() do PHP\";'),('pt-br','messages:user-mail-no-addy','s:54:\"Tentou envia