ô existente\";'),('pt-br','messages:botpasswords-label-appid','s:14:\"Nome do robô:\";'),('pt-br','messages:botpasswords-label-create','s:5:\"Criar\";'),('pt-br','messages:botpasswords-label-update','s:9:\"Atualizar\";'),('pt-br','messages:botpasswords-label-cancel','s:8:\"Cancelar\";'),('pt-br','messages:botpasswords-label-delete','s:6:\"Apagar\";'),('pt-br','messages:botpasswords-label-resetpassword','s:21:\"Redefinir a sua senha\";'),('pt-br','messages:botpasswords-label-grants','s:23:\"Permissões aplicáveis\";'),('pt-br','messages:botpasswords-help-grants','s:290:\"As concessões de permissões permitem acesso a permissões já detidas pela sua conta de usuário. Fazer uma concessão aqui não fornece acesso a quaisquer permissões que a usa conta de usuário não possua. Consulte a [[Special:ListGrants|tabela de concessões]] para mais informação.\";'),('pt-br','messages:botpasswords-label-grants-column','s:9:\"Concedido\";'),('pt-br','messages:botpasswords-bad-appid','s:37:\"O nome de robô \"$1\" não é válido.\";'),('pt-br','messages:botpasswords-insert-failed','s:64:\"Falha ao adicionar o nome de robô \"$1\". Ele já foi adicionado?\";'),('pt-br','messages:botpasswords-update-failed','s:61:\"Falha ao atualizar o nome do robô \"$1\". Elo já foi apagado?\";'),('pt-br','messages:botpasswords-created-title','s:21:\"Senha de robô criada\";'),('pt-br','messages:botpasswords-created-body','s:70:\"A senha de robo para o robô de nome \"$1\" do usuário \"$2\" foi criada.\";'),('pt-br','messages:botpasswords-updated-title','s:25:\"Senha de robô atualizada\";'),('pt-br','messages:botpasswords-updated-body','s:75:\"A senha de robô para o robô de nome \"$1\" do usuário \"$2\" foi atualizada.\";'),('pt-br','messages:botpasswords-deleted-title','s:20:\"Senha de bot apagada\";'),('pt-br','messages:botpasswords-deleted-body','s:72:\"A senha de robô para o robô de nome \"$1\" do usuário \"$2\" foi apagada.\";'),('pt-br','messages:botpasswords-newpassword','s:341:\"A nova senha para se aute