ticar-se.\";'),('pt-br','messages:resetpass-expired-soft','s:156:\"Sua senha expirou e necessita ser resetada. Por favor escolha uma nova agora, ou clique \"{{int:authprovider-resetpass-skip-label}}\" para resetar mais tarde.\";'),('pt-br','messages:resetpass-validity-soft','s:153:\"Sua senha não é válida: $1\n\nPor favor escolha uma nova senha agora, ou clique \"{{int:authprovider-resetpass-skip-label}}\" para redefini-la mais tarde.\";'),('pt-br','messages:passwordreset','s:15:\"Redefinir senha\";'),('pt-br','messages:passwordreset-text-one','s:48:\"Complete este formulário para trocar sua senha.\";'),('pt-br','messages:passwordreset-text-many','s:59:\"{{PLURAL:$1|Preencha um dos campos para trocar sua senha.}}\";'),('pt-br','messages:passwordreset-disabled','s:55:\"Redefinições de senha foram desabilitadas nesta wiki.\";'),('pt-br','messages:passwordreset-emaildisabled','s:51:\"Os recursos de e-mail foram desativados nesta wiki.\";'),('pt-br','messages:passwordreset-username','s:17:\"Nome de usuário:\";'),('pt-br','messages:passwordreset-domain','s:9:\"Domínio:\";'),('pt-br','messages:passwordreset-email','s:20:\"Endereço de e-mail:\";'),('pt-br','messages:passwordreset-emailtitle','s:33:\"Detalhes da conta em {{SITENAME}}\";'),('pt-br','messages:passwordreset-emailtext-ip','s:569:\"Alguém (provavelmente você, a partir do endereço IP $1)\nsolicitou um lembrete dos seus detalhes de conta para {{SITENAME}} ($4).\n{{PLURAL:$3|A seguinte conta está associada|As seguintes contas estão associadas}} a este e-mail:\n\n$2\n\n{{PLURAL:$3|Esta senha temporária vai|Essas senhas temporárias vão}} expirar em {{PLURAL:$5|um dia|$5 dias}}.\nVocê deve efetuar login e escolher uma nova senha agora.\nSe você conseguir lembrar da senha, ignore este e-mail e continue\nusando sua senha anterior. Caso contrário, prossiga com as instruções\ndisponíveis no link.\";'),('pt-br','messages:passwordreset-emailtext-user','s:559:\"O usuário $1 da {{SITENAME}} pediu a recuperação dos detalhes da sua conta na {{SITENAME}} ($4). {{PLURAL:$3|A seguinte conta está associada|As seguintes contas estão associadas}} a este e-mail:\n\n$2\n\n{{PLURAL:$3|Esta senha temporária irá|Estas senhas temporárias irão}} expirar dentro de {{PLURAL:$5|um dia|$5 dias}}. Deve autenticar-se e escolher uma senha nova agora. Se este pedido não foi feito por si, ou se entretanto se recordou da sua senha original e já não deseja alterá-la, pode ignorar esta mensagem e continuar a usar a senha antiga.\";'),('pt-br','messages:passwordreset-emailelement','s:37:\"Usuário: \n$1\n\nSenha temporária: \n$2\";'),('pt-br','messages:passwordreset-emailsentemail','s:125:\"Se este é um endereço de e-mail registrado para a sua conta, em seguida, um e-mail de redefinição de senha será enviada.\";'),('pt-br','messages:passwordreset-emailsentusername','s:115:\"Se houver um endereço de email associado a esta conta, ser-lhe-á enviada uma mensagem para redefinir a sua senha.\";'),('pt-br','messages:passwordreset-nocaller','s:34:\"Um interlocutor deve ser fornecido\";'),('pt-br','messages:passwordreset-nosuchcaller','s:30:\"O interlocutor não existe: $1\";'),('pt-br','messages:passwordreset-ignored','s:91:\"A redefinição da senha não foi realizada. Talvez o provedor não tenha sido configurado?\";'),('pt-br','messages:passwordreset-invalidemail','s:29:\"Endereço de e-mail inválido\";'),('pt-br','messages:passwordreset-nodata','s:62:\"Não foram fornecidos nome de usuário nem endereço de e-mail\";'),('pt-br','messages:changeemail','s:37:\"Alterar ou remover endereço de email\";'),('pt-br','messages:changeemail-header','s:224:\"Preencha este formulário para alterar seu endereço de e-mail. Se você gostaria de remover a associação de qualquer endereço de e-mail da sua conta, deixe o novo endereço de email em branco quando enviar o formulário.\";'),('pt-br','messages:changeemail-no-info','s:69:\"Para acessar diretamente esta página você tem de estar autenticado.\";'),('pt-br','messages:changeemail-oldemail','s:26:\"Endereço de e-mail atual:\";'),('pt-br','messages:changeemail-newemail','s:25:\"Novo endereço de e-mail:\";'),('pt-br','messages:changeemail-newemail-help','s:224:\"Este campo deve ser deixado em branco se você quiser remover o seu endereço de e-mail. Você não será capaz de redefinir uma senha esquecida e não receber e-mails a partir desta wiki se o endereço de email é removido.\";'),('pt-br','messages:changeemail-none','s:8:\"(nenhum)\";'),('pt-br','messages:changeemail-password','s:23:\"Sua senha {{SITENAME}}:\";'),('pt-br','messages:changeemail-submit','s:14:\"Alterar e-mail\";'),('pt-br','messages:changeemail-throttled','s:102:\"Você realizou demasiadas tentativas de se registrar.\nPor favor, aguarde $1 antes de tentar novamente.\";'),('pt-br','messages:changeemail-nochange','s:45:\"Por favor insira um novo endereço de e-mail.\";'),('pt-br','messages:resettokens','s:19:\"Reiniciar os tokens\";'),('pt-br','messages:resettokens-text','s:205:\"Você pode reiniciar os tokens, que permitem o acesso a certos dados privados associados à sua conta, aqui.\n\nVocê só deve reiniciá-los se compartilhou-os com alguém ou se a sua conta foi comprometida.\";'),('pt-br','messages:resettokens-no-tokens','s:35:\"Não existem tokens para reiniciar.\";'),('pt-br','messages:resettokens-tokens','s:10:\"Símbolos:\";'),('pt-br','messages:resettokens-token-label','s:20:\"$1 (valor atual: $2)\";'),('pt-br','messages:resettokens-watchlist-token','s:118:\"Tokens para o feed da web (Atom/RSS) das [[Special:Watchlist|mudanças de páginas em sua lista de páginas vigiadas]]\";'),('pt-br','messages:resettokens-done','s:19:\"Tokens reiniciados.\";'),('pt-br','messages:resettokens-resetbutton','s:29:\"Reiniciar tokens selecionados\";'),('pt-br','messages:bold_sample','s:16:\"Texto em negrito\";'),('pt-br','messages:bold_tip','s:16:\"Texto em negrito\";'),('pt-br','messages:italic_sample','s:17:\"Texto em itálico\";'),('pt-br','messages:italic_tip','s:17:\"Texto em itálico\";'),('pt-br','messages: