ocê <strong>[$1 fizer login]</strong> ou <strong>[$2 criar uma conta]</strong>, suas edições serão atribuídas ao seu nome de usuário, juntamente com outros benefícios.\";'),('pt-br','messages:anonpreviewwarning','s:107:\"\'\'Você não está logado. Gravar registará o seu endereço IP no histórico de edições desta página.\'\'\";'),('pt-br','messages:missingsummary','s:137:\"\'\'\'Lembrete:\'\'\' Você não introduziu um sumário de edição. Se clicar novamente em Salvar, a sua edição será salva sem um sumário.\";'),('pt-br','messages:selfredirect','s:286:\"<strong>Aviso:</strong> Você esta redirecionando esta pagina para ela mesmo. Você pode ter especificado o caminho errado para redirecionar, ou você pode estar editando a pagina errada. Se você clicar \"{{int:savearticle}}\" novamente, o redirecionamento será criado de qualquer modo.\";'),('pt-br','messages:missingcommenttext','s:45:\"Por favor, introduzida um comentário abaixo.\";'),('pt-br','messages:missingcommentheader','s:179:\"\'\'\'Lembrete:\'\'\' Você não introduziu um assunto/título para este comentário.\nSe você clicar novamente \"{{int:savearticle}}\", a sua edição será salva sem um assunto/título.\";'),('pt-br','messages:summary-preview','s:32:\"Previsão do resumo de edição:\";'),('pt-br','messages:subject-preview','s:29:\"Previsão do assunto/título:\";'),('pt-br','messages:previewerrortext','s:60:\"Ocorreu um erro ao tentar pré-visualizar suas alterações.\";'),('pt-br','messages:blockedtitle','s:26:\"O usuário está bloqueado\";'),('pt-br','messages:blockedtext','s:712:\"\'\'\'O seu nome de usuário ou endereço de IP foi bloqueado.\'\'\'\n\nO bloqueio foi realizado por $1.\nO motivo apresentado foi \'\'$2\'\'.\n\n* Início do bloqueio: $8\n* Expiração do bloqueio: $6\n* Destino do bloqueio: $7\n\nVocê pode contatar $1 ou outro [[{{MediaWiki:Grouppage-sysop}}|administrador]] para discutir sobre o bloqueio.\n\nVocê só poderá utilizar a funcionalidade \"Contatar usuário\" se um endereço de \'\'e-mail\'\' válido estiver especificado em suas [[Special:Preferences|preferências de usuário]] e você não tiver sido bloqueado de utilizar tal recurso.\nO seu endereço de IP atual é $3 e a ID de bloqueio é #$5.\nPor favor, inclua todos os detalhes acima em quaisquer tentativas de esclarecimento.\";'),('pt-br','messages:autoblockedtext','s:811:\"O seu endereço de IP foi bloqueado de forma automática, uma vez que foi utilizado recentemente por outro usuário, o qual foi bloqueado por $1.\nO motivo apresentado foi:\n\n:\'\'$2\'\'\n\n* Início do bloqueio: $8\n* Expiração do bloqueio: $6\n* Destino do bloqueio: $7\n\nVocê pode contatar $1 ou outro [[{{MediaWiki:Grouppage-sysop}}|administrador]] para discutir sobre o bloqueio.\n\nNote que não poderá utilizar a funcionalidade \"Contatar usuário\" se não possuir uma conta nesta wiki ({{SITENAME}}) com um endereço de \'\'e-mail\'\' válido indicado nas suas [[Special:Preferences|preferências de usuário]] ou se tiver sido bloqueado de utilizar tal recurso.\n\nSeu endereço de IP no momento é $3 e sua ID de bloqueio é #$5.\nPor favor, inclua tais dados em qualquer tentativa de esclarecimentos que for realizar.\";'),('pt-br','messages:systemblockedtext','s:330:\"O seu nome de usuário ou endereço IP foram bloqueados automaticamente pelo MediaWiki.\nO motivo fornecido é:\n\n:<em>$2</em>\n\n* Início do bloqueio: $8\n* Expiração do bloqueio: $6\n* Destinatário do bloqueio: $7\n\nO seu endereço IP atual é $3.\nInclua todos os detalhes acima em quaisquer contatos sobre este assunto, por favor.\";'),('pt-br','messages:blockednoreason','s:23:\"sem motivo especificado\";'),('pt-br','messages:whitelistedittext','s:44:\"Você precisa $1 para poder editar páginas.\";'),('pt-br','messages:confirmedittext','s:190:\"Você precisa confirmar o seu endereço de e-mail antes de começar a editar páginas.\nPor favor, introduza um e valide-o através das suas [[Special:Preferences|preferências de usuário]].\";'),('pt-br','messages:nosuchsectiontitle','s:38:\"Não foi possível encontrar a seção\";'),('pt-br','messages:nosuchsectiontext','s:124:\"Você tentou editar uma seção que não existe.\nEla pode ter sido movida ou removido enquanto você estava vendo a página.\";'),('pt-br','messages:loginreqtitle','s:24:\"Autenticação requerida\";'),('pt-br','messages:loginreqlink','s:13:\"autenticar-se\";'),('pt-br','messages:loginreqpagetext','s:56:\"É necessário $1 para poder visualizar outras páginas.\";'),('pt-br','messages:accmailtitle','s:14:\"Senha enviada.\";'),('pt-br','messages:accmailtext','s:189:\"Uma senha gerada aleatoriamente para [[User talk:$1|$1]] foi enviada para $2.\n\nEla pode ser alterada na página \'\'[[Special:ChangePassword|de troca de senha]]\'\', após o início de sessão.\";'),('pt-br','messages:newarticle','s:6:\"(Nova)\";'),('pt-br','messages:newarticletext','s:246:\"Você seguiu um link para uma página que ainda não existe.\nPara criá-la, comece escrevendo na caixa abaixo (veja [$1 a página de ajuda] para mais informações).\nSe você chegou aqui por engano, clique no botão \'\'\'voltar\'\'\' do seu navegador.\";'),('pt-br','messages:anontalkpagetext','s:522:\"---\n<em> Esta é a pagina de discussão para usuários anônimos que ainda não ciaram uma conta, ou para aqueles que a usa. </em>\nNós entretanto temos que usar o endereço numérico de IP para identifica-lo/a.\nEste endereço de IP pode ser compartilhado por vários usuários.\nse você é um usuário anônimo e sente que aquele comentário irrelevante foi direcionado à você, por favor [[Special:CreateAccount|Criar Conta]] ou [[Special:UserLogin|Logar]] para evitar futuras confusões com outros usuários anônimos.\";'),('pt-br','messages:noarticletext','s:331:\"Não há conteúdo nesta página no momento.\nVocê pode [[Special:Search/{{PAGENAME}}|pesquisar pelo título desta página]] em outras páginas, <span class=\"plainlinks\">[{{fullurl:{{#Special:Log}}|page={{FULLPAGENAMEE}}}} buscar por registros relacionados],\nou [{{fullurl:{{FULLPAGENAME}}|action=edit}} criar esta página]</span>.\";'),('pt-br','messages:noarticletext-nopermission','s:342:\"No momento, não há conteúdo nesta página\nVocê pode [[Special:Search/{{PAGENAME}}|pesquisar pelo título desta página]] em outras páginas,\nou <span class=\"plainlinks\">[{{fullurl:{{#Special:Log}}|page={{FULLPAGENAMEE}}}} buscar por registros relacionados] </span>. Note que, no entanto, você não tem permissão para criar esta página.\";'),('pt-br','messages:missing-revision','s:303:\"A revisão #$1 da página denominada \"{{FULLPAGENAME}}\" não existe.\n\nIsto é geralmente causado por seguir um link de histórico desatualizado para uma página que foi eliminada.\nOs detalhes podem ser encontrados no [{{fullurl:{{#Special:Log}}/delete|page={{FULLPAGENAMEE}}}} registro de eliminação].\";'),('pt-br','messages:userpage-userdoesnotexist','s:111:\"A conta \"<nowiki>$1</nowiki>\" não se encontra registrada.\nVerifique se deseja mesmo criar/editar esta página.\";'),('pt-br','messages:userpage-userdoesnotexist-view','s:47:\"A conta de usuário \"$1\" não está registrada.\";'),('pt-br','messages:blocked-notice-logextract','s:116:\"Este usuário está atualmente bloqueado.\nO registro de bloqueio mais recente é fornecido abaixo, para referência:\";'),('pt-br','messages:clearyourcache','s:730:\"<strong>Nota:</strong> Após salvar, você pode ter que limpar o \"cache\" do seu navegador para ver as alterações.\n*<strong>Firefox / Safari:</strong> Pressione <em>Shift</em> enquanto clica <em>Recarregar</em>, ou pressione <em>Ctrl-F5</em> ou <em>Ctrl-R</em> (<em>⌘-R</em> no Mac)\n*<strong>Google Chrome:</strong> Pressione <em>Ctrl-Shift-R</em> (<em>⌘-Shift-R</em> no Mac)\n* <strong>Internet Explorer:</strong> Pressione<em>Ctrl</em> enquanto clica <em>Recarregar</em>, ou Pressione <em>Ctrl-F5</em>\n* <strong>Opera:</strong> Vá para <em>Menu → Configurações</em> (<em>Opera → Preferencias</em> no Mac) e depois para <em>Privacidade e Segurança → Limpar dados de navegação → Imagens e arquivos em cache</em>.\";'),('pt-br','messages:usercssyoucanpreview','s:92:\"\'\'\'Dica:\'\'\' Utilize o botão \"{{int:showpreview}}\" para testar seu novo CSS antes de salvar.\";'),('pt-br','messages:userjsyoucanpreview','s:99:\"\'\'\'Dica:\'\'\' Utilize o botão \"{{int:showpreview}}\" para testar seu novo JavaScript antes de salvar.\";'),('pt-br','messages:usercsspreview','s:111:\"\'\'\'Lembre-se de que você está apenas previsualizando o seu CSS particular.\'\'\'\n\'\'\'Ele ainda não foi salvo!\'\'\'\";'),('pt-br','messages:userjspreview','s:110:\"\'\'\'Lembre-se que está apenas testando/prevendo o seu JavaScript particular e que ele ainda não foi salvo!\'\'\'\";'),('pt-br','messages:sitecsspreview','s:99:\"\'\'\'Lembre-se de que você está apenas previsualizando este CSS.\'\'\'\n\'\'\'Ele ainda não foi salvo!\'\'\'\";'),('pt-br','messages:sitejspreview','s:114:\"\'\'\'Lembre-se de que você está apenas previsualizando este código JavaScript.\'\'\'\n\'\'\'Ele ainda não foi salvo!\'\'\'\";'),('pt-br','messages:userinvalidcssjstitle','s:193:\"\'\'\'Aviso:\'\'\' Não existe um tema \"$1\". Lembre-se que as páginas .css e  .js utilizam um título em minúsculas, exemplo: {{ns:user}}:Alguém/vector.css aposto a {{ns:user}}:Alguém/Vector.css.\";'),('pt-br','messages:updated','s:12:\"(Atualizado)\";'),('pt-br','messages:note','s:11:\"\'\'\'Nota:\'\'\'\";'),('pt-br','messages:previewnote','s:95:\"\'\'\'Lembre-se de que isto é apenas uma previsão.\'\'\'\nSuas alterações ainda não foram salvas!\";'),('pt-br','messages:continue-editing','s:27:\"Ir para a área de edição\";'),('pt-br','messages:previewconflict','s:115:\"Esta previsão reflete o texto que está na área de edição acima e como ele aparecerá se você escolher salvar.\";'),('pt-br','messages:session_fail_preview','s:338:\"Pedimos desculpas, mas não foi possível processar a sua edição devido à perda de dados da sua sessão.\n\'\'\'Por favor, verifique se você ainda está autenticado e tente novamente.\'\'\'\nCaso continue não funcionando, tente [[Special:UserLogout|sair]] e voltar a entrar na sua conta, e cheque se seu navegador permite cookies desse site.\";'),('pt-br','messages:session_fail_preview_html','s:487:\"Desculpe! Não foi possível processar a sua edição devido a uma perda de dados de sessão.\n\n<em>Como {{SITENAME}} possui HTML bruto ativo, a previsão não será exibida como uma precaução contra ataques por JavaScript.\n\n<strong>Se esta é uma tentativa de edição legítima, por favor tente novamente.</strong>\nCaso continue não funcionando, tente [[Special:UserLogout|desautenticar-se]] e voltar a entrar na sua conta, e cheque se seu navegador permite cookies vindo deste site.\";'),('pt-br','messages:token_suffix_mismatch','s:288:\"\'\'\'A sua edição foi rejeitada uma vez que seu software de navegação mutilou os sinais de pontuação do sinal de edição. A edição foi rejeitada para evitar perdas no texto da página.\nIsso acontece ocasionalmente quando se usa um serviço de proxy anonimizador mal configurado.\'\'\'\";'),('pt-br','messages:edit_form_incomplete','s:150:\"\'\'\'Algumas partes do formulário de edição não chegaram ao servidor; verifique que a sua edição continua intacta e tente novamente, por favor.\'\'\'\";'),('pt-br','messages:editing','s:11:\"Editando $1\";'),('pt-br','messages:creating','s:10:\"Criando $1\";'),('pt-br','messages:editingsection','s:21:\"Editando $1 (seção)\";'),('pt-br','messages:editingcomment','s:26:\"Editando $1 (nova seção)\";'),('pt-br','messages:editconflict','s:24:\"Conflito de edição: $1\";'),('pt-br','messages:explainconflict','s:312:\"Alguém mudou a página enquanto você a estava editando.\nA área de texto acima mostra o texto original.\nSuas mudanças são mostradas na área abaixo.\nVocê terá que mesclar suas modificações no texto existente.\n\'\'\'SOMENTE\'\'\' o texto na área acima será salvo quando você pressionar \"{{int:savearticle}}\".\";'),('pt-br','messages:yourtext','s:9:\"Seu texto\";'),('pt-br','messages:storedversion','s:16:\"Versão guardada\";'),('pt-br','messages:nonunicodebrowser','s:276:\"\'\'\'AVISO: O seu navegador não é compatível com as especificações unicode.\'\'\'\nUm contorno terá de ser utilizado para permitir que você possa editar as páginas com segurança: os caracteres não-ASCII aparecerão na caixa de edição no formato de códigos hexadecimais.\";'),('pt-br','messages:editingold','s:164:\"\'\'\'CUIDADO: Você está editando uma revisão desatualizada desta página.\'\'\'\nSe você salvá-la, todas as mudanças feitas a partir desta revisão serão perdidas.\";'),('pt-br','messages:yourdiff','s:11:\"Diferenças\";'),('pt-br','messages:copyrightwarning','s:519:\"Por favor, note que todas as suas contribuições em {{SITENAME}} são consideradas como lançadas nos termos da licença $2 (veja $1 para detalhes). Se não deseja que o seu texto seja inexoravelmente editado e redistribuído de tal forma, não o envie.<br />\nVocê está, ao mesmo tempo, garantindo-nos que isto é algo escrito por você mesmo ou algo copiado de uma fonte de textos em domínio público ou similarmente de teor livre.\n\'\'\'NÃO ENVIE TRABALHO PROTEGIDO POR DIREITOS AUTORAIS SEM A DEVIDA PERMISSÃO!\'\'\'\";'),('pt-br','messages:copyrightwarning2','s:500:\"Por favor, note que todas as suas contribuições em {{SITENAME}} podem ser editadas, alteradas ou removidas por outros contribuidores. Se você não deseja que o seu texto seja inexoravelmente editado, não o envie.<br />\nVocê está, ao mesmo tempo, a garantir-nos que isto é algo escrito por si, ou algo copiado de alguma fonte de textos em domínio público ou similarmente de teor livre (veja $1 para detalhes).\n\'\'\'NÃO ENVIE TRABALHO PROTEGIDO POR DIREITOS DE AUTOR SEM A DEVIDA PERMISSÃO!\'\'\'\";'),('pt-br','messages:editpage-cannot-use-custom-model','s:59:\"O modelo de conteúdo desta página não pode ser alterado.\";'),('pt-br','messages:longpageerror','s:173:\"\'\'\'Erro: O texto que submeteu ocupa {{PLURAL:$1|um kilobyte|$1 kilobytes}}, que excede o máximo de {{PLURAL:$2|um kilobyte|$2 kilobytes}}.\'\'\'\nA página não pode ser salva.\";'),('pt-br','messages:readonlywarning','s:290:\"\'\'\'Aviso: O banco de dados foi bloqueado para manutenção, por isso você não poderá salvar a sua edição neste momento.\'\'\'\nTalvez você queira copiar o seu texto num editor externo e guardá-lo, para posterior envio.\n\nQuem bloqueou o banco de dados forneceu a seguinte explicação: $1\";'),('pt-br','messages:protectedpagewarning','s:191:\"\'\'\'Atenção: Esta página foi protegida para que apenas usuários com privilégios de administrador possam editá-la.\'\'\'\nA última entrada no histórico é fornecida abaixo como referência:\";'),('pt-br','messages:semiprotectedpagewarning','s:168:\"\'\'\'Nota:\'\'\' Esta página foi protegida, sendo que apenas usuários registrados poderão editá-la.\nA última entrada no histórico é fornecida abaixo para referência:\";'),('pt-br','messages:cascadeprotectedwarning','s:266:\"<strong>Aviso:</strong> Esta página foi protegida para que somente usuários com [[Special:ListGroupRights|direitos específicos]] possam editá-la porque ela é transcluída {{PLURAL:$1|na seguinte página protegida|nas seguintes páginas protegidas}} por cascata:\";'),('pt-br','messages:titleprotectedwarning','s:201:\"\'\'\'Atenção: esta página foi protegida; [[Special:ListGroupRights|privilégios específicos]] são necessários para criá-la.\'\'\'\nA última entrada no histórico é fornecida abaixo como referência:\";'),('pt-br','messages:templatesused','s:72:\"{{PLURAL:$1|Predefinição usada|Predefinições usadas}} nesta página:\";'),('pt-br','messages:templatesusedpreview','s:74:\"{{PLURAL:$1|Predefinição usada|Predefinições usadas}} nesta previsão:\";'),('pt-br','messages:templatesusedsection','s:80:\"{{PLURAL:$1|Predefinição utilizada|Predefinições utilizadas}} nesta seção:\";'),('pt-br','messages:template-protected','s:11:\"(protegida)\";'),('pt-br','messages:template-semiprotected','s:15:\"(semiprotegida)\";'),('pt-br','messages:hiddencategories','s:81:\"Esta página pertence a {{PLURAL:$1|uma categoria oculta|$1 categorias