('pt-br','messages:proxyblockreason','s:191:\"O seu endereço de IP foi bloqueado por ser um proxy público. Por favor contacte o seu fornecedor do serviço de Internet ou o apoio técnico e informe-os deste problema de segurança grave.\";'),('pt-br','messages:sorbsreason','s:95:\"O seu endereço IP encontra-se listado como proxy aberto pela DNSBL utilizada por {{SITENAME}}.\";'),('pt-br','messages:sorbs_create_account_reason','s:128:\"O seu endereço de IP encontra-se listado como proxy aberto na DNSBL utilizada por {{SITENAME}}. Você não pode criar uma conta\";'),('pt-br','messages:softblockrangesreason','s:94:\"Contribuições anônimas não são permitidas do seu endereço  IP $1 Por favor, faça login.\";'),('pt-br','messages:xffblockreason','s:151:\"Um endereço IP presente no cabeçalho X-Forwarded-For, seu ou do servidor proxy que está usando, foi bloqueado. O motivo original do bloqueio foi: $1\";'),('pt-br','messages:cant-see-hidden-user','s:189:\"O usuário que você está tentando bloquear já está bloqueado ou oculto. Como você não possui privilégio de ocultar usuários, você não pode ver ou editar o bloqueio desse usuário.\";'),('pt-br','messages:ipbblocked','s:105:\"Não é possível que você bloqueie ou desbloqueie outros usuários, já que você se encontra bloqueado\";'),('pt-br','messages:ipbnounblockself','s:42:\"Não é permitido que você se desbloqueie\";'),('pt-br','messages:lockdb','s:22:\"Trancar banco de dados\";'),('pt-br','messages:unlockdb','s:27:\"Desbloquear a base de dados\";'),('pt-br','messages:lockdbtext','s:350:\"Trancar o banco de dados suspenderá a habilidade de todos os usuários de editarem páginas, mudarem suas preferências, lista de páginas vigiadas e outras coisas que requerem mudanças na base de dados.<br />\nPor favor, confirme que você realmente pretende fazer isso e que vai destrancar a base de dados quando a manutenção estiver concluída.\";'),('pt-br','messages:unlockdbtext','s:281:\"Desbloquear a base de dados vai restaurar a habilidade de todos os usuários de editarem páginas, mudarem suas preferências, alterarem suas listas de páginas vigiadas e outras coisas que requerem mudanças na base de dados.\nPor favor, confirme que realmente pretende fazer isso.\";'),('pt-br','messages:lockconfirm','s:50:\"Sim, eu realmente desejo bloquear a base de dados.\";'),('pt-br','messages:unlockconfirm','s:53:\"Sim, eu realmente desejo desbloquear a base de dados.\";'),('pt-br','messages:lockbtn','s:22:\"Bloquear base de dados\";'),('pt-br','messages:unlockbtn','s:25:\"Desbloquear base de dados\";'),('pt-br','messages:locknoconfirm','s:47:\"Você não selecionou a caixa de confirmação.\";'),('pt-br','messages:lockdbsuccesssub','s:21:\"Bloqueio bem sucedido\";'),('pt-br','messages:unlockdbsuccesssub','s:24:\"Desbloqueio bem sucedido\";'),('pt-br','messages:lockdbsuccesstext','s:106:\"A base de dados da {{SITENAME}} foi bloqueada.\n<br />Lembre-se de remover o bloqueio após a manutenção.\";'),('pt-br','messages:unlockdbsuccesstext','s:34:\"O banco de dados foi desbloqueado.\";'),('pt-br','messages:lockfilenotwritable','s:160:\"O arquivo de bloqueio da base de dados não pode ser escrito. Para bloquear ou desbloquear a base de dados, este precisa de poder ser escrito pelo servidor Web.\";'),('pt-br','messages:databaselocked','s:37:\"O banco de dados já está bloqueado.\";'),('pt-br','messages:databasenotlocked','s:43:\"A base de dados não encontra-se bloqueada.\";'),('pt-br','messages:lockedbyandtime','s:21:\"(por $1 em $2 às $3)\";'),('pt-br','messages:move-page','s:8:\"Mover $1\";'),('pt-br','messages:move-page-legend','s:13:\"Mover página\";'),('pt-br','messages:movepagetext','s:1077:\"Utilizando o formulário a seguir você poderá renomear uma página, movendo todo o histórico para o novo título.\nO título anterior será transformado em um redirecionamento para o novo.\nVocê poderá optar em atualizar automaticamente os redirecionamentos que se destinem ao título original.\nCaso escolha pela não-atualização, se certifique de verificar por redirecionamentos [[Special:DoubleRedirects|duplos]] ou [[Special:BrokenRedirects|quebrados]].\nÉ de sua responsabilidade que os links continuem direcionando para onde eles devem.\n\nNote que a página <strong>não</strong> será movida se já existir uma página com o novo título, a não ser que ele seja um redirecionamento e não tenha histórico de edições.\nIsto significa que você pode renomear uma página de volta para o seu nome anterior se cometer algum engano e que não poderá sobrescrever uma página existente.\n\n<strong>Nota:</strong>\nEsta pode ser uma mudança drástica e inesperada para uma página popular;\ntenha certeza de que compreende as consequências da mudança antes de prosseguir.\";'),('pt-br','messages:movepagetext-noredirectfixer','s:1044:\"Usando o formulário abaixo, você irá alterar o nome de uma página e moverá todo o histórico desta para o nome novo.\nA página antiga será transformada numa página de redirecionamento para a nova.\nVerifique a existência de [[Special:DoubleRedirects|redirecionamentos duplos]] ou [[Special:BrokenRedirects|quebrados]].\nÉ sua responsabilidade certificar-se de que os links continuam a apontar para onde eles deveriam apontar.\n\nNote que a página <strong>não</strong> será movida se já existir uma página com o nome novo, a menos que esta página esteja vazia ou seja uma página de redirecionamento e não tenha um histórico de edições.\nIsto significa que, se você cometer um engano, poderá alterar o nome da página movida de volta para o seu nome original; e que não pode sobrescrever o conteúdo de uma página existente.\n\n<strong>Nota:</strong>\nPara páginas populares, esta operação pode representar uma mudança drástica e inesperada;\ncertifique-se de que compreende as consequências da operação antes de continuar.\";'),('pt-br','messages:movepagetalktext','s:256:\"Caso marcar esta caixa, a página de discussão associada será automaticamente movida para um novo título, a menos que uma página de discussão com conteúdo já existir lá.\n\n\nNeste caso, você deverá mover ou mesclar a página manualmente se desejar.\";'),('pt-br','messages:moveuserpage-warning','s:130:\"\'\'\'Aviso:\'\'\' Você irá mover uma página de usuário. Note que apenas a página será movida, \'\'sem\'\' alterar o nome do usuário.\";'),('pt-br','messages:movecategorypage-warning','s:223:\"<strong>Aviso:</strong> Você está prestes a mover uma página de categoria. Por favor, note que apenas a página será transferida e quaisquer páginas da categoria antiga <em>não</em> serão recategorizadas para o novo.\";'),('pt-br','messages:movenologintext','s:106:\"Você precisa ser um usuário registrado e [[Special:UserLogin|autenticado]] para poder mover uma página.\";'),('pt-br','messages:movenotallowed','s:49:\"Você não possui permissão para mover páginas.\";'),('pt-br','messages:movenotallowedfile','s:49:\"Você não possui permissão para mover arquivos.\";'),('pt-br','messages:cant-move-user-page','s:71:\"Você não possui permissão de mover páginas principais de usuários.\";'),('pt-br','messages:cant-move-to-user-page','s:120:\"Você não tem permissão para mover uma página para uma página de usuários (exceto para uma subpágina de usuário).\";'),('pt-br','messages:cant-move-category-page','s:63:\"Você não possui permissão para mover páginas de categorias.\";'),('pt-br','messages:cant-move-to-category-page','s:80:\"Você não tem permissão para mover uma página para uma categoria de páginas.\";'),('pt-br','messages:cant-move-subpages','s:49:\"Você não tem permissão para mover subpáginas.\";'),('pt-br','messages:namespace-nosubpages','s:48:\"O espaço nominal \"$1\" não permite subpáginas.\";'),('pt-br','messages:newtitle','s:13:\"Novo título:\";'),('pt-br','messages:move-watch','s:19:\"Vigiar esta página\";'),('pt-br','messages:movepagebtn','s:13:\"Mover página\";'),('pt-br','messages:pagemovedsub','s:26:\"Página movida com sucesso\";'),('pt-br','messages:movepage-moved','s:31:\"\'\'\'\"$1\" foi movida para \"$2\"\'\'\'\";'),('pt-br','messa