er a simples soma abaixo e inserir sua resposta no respectivo campo ([[Special:Captcha/help|detalhes]])\";'),('pt-br','messages:captcha-badlogin','s:210:\"Como prevenção contra sistemas automatizados de pesquisa e descoberta de senhas, será necessário resolver a simples soma abaixo e inserir sua resposta no respectivo campo ([[Special:Captcha/help|detalhes]])\";'),('pt-br','messages:captcha-createaccount','s:223:\"Para proteger a wiki contra sistemas automatizados de criação de contas, solicitamos que resolva a soma simples apresentada abaixo e introduza a resposta no respectivo campo  ([[Special:Captcha/help|mais informações]]):\";'),('pt-br','messages:captcha-createaccount-fail','s:45:\"Código CAPTCHA incorreto ou não preenchido.\";'),('pt-br','messages:captcha-create','s:146:\"Para criar a página, por favor resolva a simples soma abaixo e entre com a resposta no respectivo campo ([[Special:Captcha/help|o que é isto?]])\";'),('pt-br','messages:captcha-sendemail','s:178:\"Como proteção ao wiki contra spam automatizado, será necessário resolver a simples soma abaixo e inserir sua resposta no respectivo campo ([[Special:Captcha/help|detalhes]]):\";'),('pt-br','messages:captcha-sendemail-fail','s:45:\"Código CAPTCHA incorreto ou não preenchido.\";'),('pt-br','messages:captcha-disabledinapi','s:87:\"Esta operação necessita de captcha, por isso não pode ser realizada através da API.\";'),('pt-br','messages:captchahelp-title','s:19:\"Ajuda com o Captcha\";'),('pt-br','messages:captchahelp-cookies-needed','s:84:\"Você precisa ter cookies habilitados em seu navegador para que isso possa funcionar\";'),('pt-br','messages:captchahelp-text','s:1171:\"Sites abertos a inserções públicas, como é o caso desta wiki, são vulneráveis a spammers que utilizam ferramentas automatizadas para inserir seus links em diversos locais.\nRemover tais ligações posteriormente pode ser um incômodo significativo.\n\nAlgumas vezes, especialmente ao adicionar novas ligações externas a uma página, o wiki exibirá uma imagem com um texto colorido ou distorcido e pedirá que você introduza as palavras exibidas.\nUma vez que essa é uma tarefa um tanto difícil de ser automatizada, ela possibilita que a maioria dos humanos faça as suas inserções ao mesmo tempo que inibe as que forem feitas por spammers e mecanismos automatizados.\n\nInfelizmente, isso pode ser um inconveniente para usuários com limitações visuais ou que naveguem através de mecanismos baseados em texto ou baseados em voz.\nNo momento, não está disponível uma alternativa em áudio.\nPor favor, contate os [[Special:ListAdmins|administradores do sítio]] em casos que seja necessária a assistência de alguém para que você possa fazer as suas inserções legítimas.\n\nPressione o botão \'voltar\' de seu navegador para retornar à página de edição.\";'),('pt-br','messages:captcha-addurl-whitelist','s:324:\" #<!-- deixe este linha exatamente como está --> <pre>\n# A sintaxe é a que se segue:\n#  * Tudo desde o caractere \"#\" até ao fim da linha é um comentário\n#  * Qualquer linha não vazia é um fragmento de regex que irá apenas verificar o servidor dentro das URLs\n  #</pre> <!-- deixe este linha exatamente como está -->\";'),('pt-br','messages:right-skipcaptcha','s:72:\"Executar ações disparadoras de captcha sem ter que passar pelo captcha\";'),('pt-br','messages:imagemap_desc','s:98:\"Permite mapas de imagem clicáveis no lado do cliente usando a marca <code>&lt;imagemap&gt;</code>\";'),('pt-br','messages:imagemap_no_image','s:56:\"Erro: deve ser especificada uma imagem na primeira linha\";'),('pt-br','messages:imagemap_invalid_image','s:37:\"Erro: imagem inválida ou inexistente\";'),('pt-br','messages:imagemap_bad_image','s:53:\"Erro: a imagem está na lista negra para esta página\";'),('pt-br','messages:imagemap_no_link','s:68:\"Erro: não foi encontrada uma ligação válida ao final da linha $1\";'),('pt-br','messages:imagemap_invalid_title','s:43:\"Erro: título inválido no link da linha $1\";'),('pt-br','messages:imagemap_missing_coord','s:66:\"Erro: coordenadas insuficientes para formar uma figura na linha $1\";'),('pt-br','messages:imagemap_unrecognised_shape','s:156:\"Erro: figura não reconhecida na linha $1. Cada linha precisa iniciar com: <code>default</code>, <code>rect</code>, <code>circle</code> ou <code>poly</code>\";'),('pt-br','messages:imagemap_invalid_coord','s:74:\"Erro: coordenada inválida na linha $1, é necessário que seja um número\";'),('pt-br','messages:imagemap_invalid_desc','s:89:\"Erro: especificação desc inválida, é necessário que seja uma dentre: <code>$1</code>\";'),('pt-br','messages:imagemap_description','s:17:\"Sobre esta imagem\";'),('pt-br','messages:imagemap_desc_types','s:80:\"superior-direito, inferior-direito, inferior-esquerdo, superior-esquerdo, nenhum\";'),('pt-br','messages:imagemap_poly_odd','s:72:\"Erro: encontrado polígono com número ímpar de coordenadas na linha $1\";'),('pt-br','messages:nuke','s:25:\"Eliminar de forma massiva\";'),('pt-br','messages:action-nuke','s:26:\"eliminar páginas em massa\";'),('pt-br','messages:nuke-desc','s:99:\"[[Special:Nuke|Página especial]] que permite que administradores apaguem páginas de forma massiva\";'),('pt-br','messages:nuke-nopages','s:139:\"Não há novas páginas criadas [[Special:Contributions/$1|{{GENDER:$1|pelo usuário $1|pela usuária $1|por $1}}]] nas mudanças recentes.\";'),('pt-br','messages:nuke-list','s:210:\"As páginas a seguir foram recentemente criadas  [[Special:Contributions/$1|{{GENDER:$1|pelo usuário $1|pela usuária $1|por $1}}]];\nforneça uma justificativa e clique no botão equivalente para eliminá-las.\";'),('pt-br','messages:nuke-list-multiple','s:125:\"As páginas a seguir foram criadas recentemente;\nforneça uma justificativa e clique no botão equivalente para eliminá-las.\";'),('pt-br','messages:nuke-defaultreason','s:125:\"Eliminação em massa de páginas criadas [[Special:Contributions/$1|{{GENDER:$1|pelo usuário $1|pela usuária $1|por $1}}]]\";'),('pt-br','messages:nuke-m