ges:wikieditor-toolbar-help-content-signaturetimestamp-description','s:26:\"Assinatura com hora e data\";'),('pt-br','messages:wikieditor-toolbar-help-content-signaturetimestamp-result','s:141:\"--<a href=\'#\' title=\'$1:Username\'>Nome de usuário</a> (<a href=\'#\' title=\'$2:Username\'>discussão</a>) 15h54min de 10 de junho de 2009 (UTC)\";'),('pt-br','messages:wikieditor-toolbar-help-content-signature-description','s:10:\"Assinatura\";'),('pt-br','messages:wikieditor-toolbar-help-content-signature-result','s:101:\"<a href=\'#\' title=\'$1:Username\'>Nome de usuário</a> (<a href=\'#\' title=\'$2:Username\'>discussão</a>)\";'),('pt-br','messages:wikieditor-toolbar-help-content-indent-description','s:12:\"Indentação\";'),('pt-br','messages:wikieditor-toolbar-help-content-indent-syntax','s:57:\"Texto normal<br />:Texto indentado<br />::Texto indentado\";'),('pt-br','messages:wikieditor-toolbar-help-content-indent-result','s:78:\"Texto normal<dl><dd>Texto indentado<dl><dd>Texto indentado</dd></dl></dd></dl>\";'),('pt-br','messages:interlanguage-link-title','s:9:\"$1 — $2\";'),('pt-br','messages:interlanguage-link-title-nonlang','s:9:\"$1 – $2\";'),('pt-br','messages:print.css','s:56:\"/* Código CSS colocado aqui afectará as impressões */\";'),('pt-br','messages:noscript.css','s:116:\"/* Os estilos CSS colocados aqui afetarão os utilizadores que tenham o JavaScript desativado em seus navegadores */\";'),('pt-br','messages:exif-xyresolution-c','s:8:\"$1 pt/cm\";'),('pt-br','messages:version-entrypoints-articlepath','s:93:\"[https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:$wgArticlePath Caminho dos artigos]\";'),('pt-br','messages:version-entrypoints-scriptpath','s:99:\"[https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:$wgScriptPath Caminho dos <i>scripts</i>]\";'),('pt-br','messages:apihelp-main-description','s:1194:\"<div class=\"hlist plainlinks api-main-links\">\n* [[mw:API:Main_page|Documentação]]\n* [[mw:API:FAQ|FAQ]]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-api Lista de discussão]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-api-announce Anúncios da API]\n* [https://phabricator.wikimedia.org/maniphest/query/GebfyV4uCaLd/#R Erros e pedidos]\n</div>\n<strong>Estado:</strong> Todas as funcionalidades mostradas nesta página devem ter o comportamento documentado mas a API ainda está em desenvolvimento ativo e pode ser alterada a qualquer momento. Inscreva-se na [https://lists.wikimedia.org/pipermail/mediawiki-api-announce/ lista de discussão mediawiki-api-announce] para ser informado acerca das atualizações.\n\n<strong>Pedidos incorretos:</strong> Quando são enviados pedidos incorretos à API, será devolvido um cabeçalho HTTP com a chave \"MediaWiki-API-Error\" e depois tanto o valor desse cabeçalho como o código de erro devolvido serão definidos com o mesmo valor. Para mais informação, consulte [[mw:API:Errors_and_warnings|API:Erros e avisos]].\n\n<strong>Testes:</strong> Para testar facilmente pedidos à API, visite [[Special:ApiSandbox|Testes da API]].\";'),('pt-br','messages:apihelp-main-param-maxlag','s:588:\"O atraso máximo pode ser usado quando o MediaWiki é instalado num \'\'cluster\'\' de bases de dados replicadas. Para impedir que as operações causem ainda mais atrasos de replicação do \'\'site\'\', este parâmetro pode fazer o cliente aguardar até que o atraso de replicação seja inferior ao valor especificado. Caso o atraso atual exceda esse valor, o código de erro <samp>maxlag</samp> é devolvido com uma mensagem como <samp>À espera do servidor $host: $lag segundos de atraso</samp>.<br />Consulte [[mw:Manual:Maxlag_parameter|Manual: Parâmetro maxlag]] para mais informações.\";'),('pt-br','messages:apihelp-main-param-assert','s:187:\"Se definido com o valor <kbd>user</kbd>, verificar que o utilizador está autenticado. Se definido com o valor <kbd>bot</kbd>, verificar que o utilizador tem o privilégio de conta robô.\";'),('pt-br','messages:apihelp-main-param-responselanginfo','s:87:\"Incluir as línguas usadas para <var>uselang</var> e <var>errorlang</var> no resultado.\";'),('pt-br','messages:apihelp-main-param-uselang','s:367:\"A língua a ser usada nas traduções de mensagens. <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd> com <kbd>siprop=languages</kbd> devolve uma lista de códigos de língua, ou especifique <kbd>user</kbd> para usar a língua nas preferências do utilizador atual, ou especifique <kbd>content</kbd> para usar a língua de conteúdo desta wiki.\";'),('pt-br','messages:apihelp-main-param-errorformat','s:401:\"O formato a ser usado no texto de avisos e erros.\n; plaintext: Texto wiki com os elementos HTML removidos e as entidades substituídas.\n; wikitext: Texto wiki sem análise sintática.\n; html: HTML.\n; raw: Chave e parâmetros da mensagem.\n; none: Sem saída de texto, só os códigos de erro.\n; bc: Formato usado antes do MediaWiki 1.29. <var>errorlang</var> e <var>errorsuselocal</var> são ignorados.\";'),('pt-br','messages:apihelp-main-param-errorlang','s:363:\"A língua a ser usada para avisos e erros. <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd> com <kbd>siprop=languages</kbd> devolve uma lista de códigos de língua, ou especifique <kbd>content</kbd> para usar a língua de conteúdo desta wiki, ou especifique <kbd>uselang</kbd> para usar o mesmo valor que o parâmetro <var>uselang</var>.\";'),('pt-br','messages:apihelp-main-param-errorsuselocal','s:116:\"Se fornecido, os textos de erro utilizarão mensagens personalizadas localmente do espaço nominal {{ns:MediaWiki}}.\";'),('pt-br','messages:apihelp-block-param-userid','s:101:\"O identificador do utilizador a ser bloqueado. Não pode ser usado em conjunto com <var>$1user</var>.\";'),('pt-br','messages:apihelp-block-param-expiry','s:259:\"O período de expiração. Pode ser relativo (p. ex. <kbd>5 meses</kbd> ou <kbd>2 semanas</kbd>) ou absoluto (p. ex. <kbd>2014-09-18T12:34:56Z</kbd>). Se definido como <kbd>infinite</kbd>, <kbd>indefinite</kbd> ou <kbd>never</kbd>, o bloqueio nunca expirará.\";'),('pt-br','messages:apihelp-block-param-noemail','s:116:\"Impedir o utilizador de enviar correio eletrónico através da wiki. (Requer o privilégio <code>blockemail</code>).\";'),('pt-br','messages:apihelp-block-param-allowusertalk','s:149:\"Permitir que o utilizador edite a sua própria página de discussão (depende de <var>[[mw:Manual:$wgBlockAllowsUTEdit|$wgBlockAllowsUTEdit]]</var>).\";'),('pt-br','messages:apihelp-block-param-tags','s:72:\"Etiquetas de modificação a aplicar à entrada no registo de bloqueios.\";'),('pt-br','messages:apihelp-changeauthenticationdata-description','s:55:\"Alterar os dados de autenticação do utilizador atual.\";'),('pt-br','messages:apihelp-changeauthenticationdata-example-password','s:83:\"Tentar alterar a palavra-passe do utilizador atual para <kbd>ExamplePassword</kbd>.\";'),('pt-br','messages:apihelp-checktoken-description','s:115:\"Verificar a validade de uma chave a partir de <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd>.\";'),('pt-br','messages:apihelp-checktoken-param-type','s:38:\"Tipo de chave que está a ser testado.\";'),('pt-br','messages:apihelp-checktoken-param-maxtokenage','s:39:\"Validade máxima da chave, em segundos.\";'),('pt-br','messages:apihelp-checktoken-example-simple','s:47:\"Testar a validade de uma chave <kbd>csrf</kbd>.\";'),('pt-br','messages:apihelp-clearhasmsg-description','s:60:\"Limpa a indicação <code>hasmsg</code> do utilizador atual.\";'),('pt-br','messages:apihelp-clientlogin-description','s:44:\"Entrar na wiki usando o processo interativo.\";'),('pt-br','messages:apihelp-clientlogin-example-login','s:118:\"Inicia o processo de entrada na wiki com o utilizador <kbd>Example</kbd> e a palavra-passe <kbd>ExamplePassword</kbd>.\";'),('pt-br','messages:apihelp-clientlogin-example-login2','s:169:\"Continuar o processo de autenticação após uma resposta  <samp>UI</samp> para autenticação de dois fatores, fornecendo uma <var>OATHToken</var> de <kbd>987654</kbd>.\";'),('pt-br','messages:apihelp-compare-description','s:159:\"Obter a diferença entre 2 páginas.\n\nTêm de ser passados um número de revisão, um título de página ou um identificador de página para o \"from\" e o \"to\".\";'),('pt-br','messages:apihelp-createaccount-param-preservestate','s:376:\"Se <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> devolveu o valor verdadeiro para <samp>hasprimarypreservedstate</samp>, pedidos marcados como <samp>primary-required</samp> devem ser omitidos. Se devolveu um valor não vazio em <samp>preservedusername</samp>, esse nome de utilizador tem de ser usado no parâmetro <var>username</var>.\";'),('pt-br','messages:apihelp-createaccount-example-create','s:112:\"Iniciar o processo de criação do utilizador <kbd>Example</kbd> com a palavra-passe <kbd>ExamplePassword</kbd>.\";'),('pt-br','messages:apihelp-createaccount-param-token','s:55:\"Chave de criação da conta, obtida no primeiro pedido.\";'),('pt-br','messages:apihelp-createaccount-param-mailpassword','s:117:\"Se qualquer valor estiver definido, uma palavra-passe aleatória será enviada por correio eletrónico ao utilizador.\";'),('pt-br','messages:apihelp-createaccount-param-reason','s:70:\"Motivo opcional de criação da conta, para ser colocado nos registos.\";'),('pt-br','messages:apihelp-createaccount-param-language','s:111:\"Código da língua a definir como padrão para o utilizador (opcional, por omissão é a língua de conteúdo).\";'),('pt-br','messages:apihelp-createaccount-example-pass','s:78:\"Criar o utilizador <kbd>testuser</kbd> com a palavra-passe <kbd>test123</kbd>.\";'),('pt-br','messages:apihelp-createaccount-example-mail','s:116:\"Criar o utilizador <kbd>testmailuser</kbd> e enviar por correio eletrónico uma palavra-passe gerada aleatoriamente.\";'),('pt-br','messages:apihelp-cspreport-description','s:202:\"Usado por \'\' browsers\'\' para reportar violações da norma \"Content Security Policy\". Este módulo nunca deve ser usado, exceto quando utilizado automaticamente por um \'\'browser\'\' compatível com a CSP.\";'),('pt-br','messages:apihelp-cspreport-param-reportonly','s:98:\"Marcar como sendo um relatório vindo de uma norma de monitorização e não de uma norma exigida.\";'),('pt-br','messages:apihelp-cspreport-param-source','s:66:\"Aquilo que gerou o cabeçalho CSP que desencadeou este relatório.\";'),('pt-br','messages:apihelp-delete-param-reason','s:95:\"Motivo para a eliminação. Se não for definido, será usado um motivo gerado automaticamente.\";'),('pt-br','messages:apihelp-delete-param-tags','s:76:\"Etiquetas de modificação a aplicar à entrada no registo de eliminações.\";'),('pt-br','messages:apihelp-delete-param-watchlist','s:163:\"Adicionar ou remover incondicionalmente a página da lista de páginas vigiadas do utilizador atual, usar as preferências ou não alterar o estado de vigilância.\";'),('pt-br','messages:apihelp-delete-param-oldimage','s:147:\"O nome da imagem antiga a ser eliminada, tal como fornecido por [[Special:ApiHelp/query+imageinfo|action=query&prop=imageinfo&iiprop=archivename]].\";'),('pt-br','messages:apihelp-delete-example-reason','s:73:\"Eliminar <kbd>Main Page</kbd> com o motivo <kbd>Preparing for move</kbd>.\";'),('pt-br','messages:apihelp-edit-param-section','s:97:\"Número da secção. <kbd>0</kbd> para a secção de topo, <kbd>new</kbd> para uma secção nova.\";'),('pt-br','messages:apihelp-edit-param-summary','s:111:\"Resumo da edição. Também é o título da secção quando $1section=new e $1sectiontitle não está definido.\";'),('pt-br','messages:apihelp-edit-param-tags','s:49:\"Etiquetas de modificação a aplicar à revisão.\";'),('pt-br','messages:apihelp-edit-param-basetimestamp','s:179:\"Data e hora da revisão de base, usada para detetar conflitos de edição. Pode ser obtida usando [[Special:ApiHelp/query+revisions|action=query&prop=revisions&rvprop=timestamp]].\";'),('pt-br','messages:apihelp-edit-param-starttimestamp','s:278:\"Data e hora de início do processo de edição, usada para detetar conflitos de edição. Pode-se obter um valor apropriado usando <var>[[Special:ApiHelp/main|curtimestamp]]</var> ao iniciar o processo de edição (por exemplo, ao carregar o conteúdo da página para edição).\";'),('pt-br','messages:apihelp-edit-param-recreate','s:71:\"Ignorar todos os erros acerca da página ter sido eliminada entretanto.\";'),('pt-br','messages:apihelp-edit-param-md5','s:181:\"A chave MD5 do parâmetro $1text, ou os parâmetros $1prependtext e $1appendtext concatenados. Se estiver definido, a edição não será realizada a menos que a chave seja correta.\";'),('pt-br','messages:apihelp-edit-param-prependtext','s:74:\"Adicionar este texto ao início da página. Tem precedência sobre $1text.\";'),('pt-br','messages:apihelp-edit-param-appendtext','s:169:\"Adicionar este texto ao fim da página. Tem precedência sobre $1text.\n\nPara acrescentar uma nova secção no fim da página, usar $1section=new em vez deste parâmetro.\";'),('pt-br','messages:apihelp-edit-param-undo','s:84:\"Desfazer esta revisão. Tem precedência sobre $1text, $1prependtext e $1appendtext.\";'),('pt-br','messages:apihelp-edit-param-undoafter','s:100:\"Desfazer todas as revisões desde $1undo até esta. Se não for definido, desfazer só uma revisão.\";'),('pt-br','messages:apihelp-edit-param-redirect','s:43:\"Resolver automaticamente redirecionamentos.\";'),('pt-br','messages:apihelp-edit-param-token','s:97:\"A chave deve ser sempre enviada como último parâmetro, ou pelo menos após o parâmetro $1text.\";'),('pt-br','messages:apihelp-edit-example-undo','s:69:\"Desfazer desde a revisão 13579 até à 13585 com resumo automático.\";'),('pt-br','messages:apihelp-expandtemplates-param-revid','s:89:\"Identificador da revisão, para <nowiki>{{REVISIONID}}</nowiki> e variáveis semelhantes.\";'),('pt-br','messages:apihelp-expandtemplates-param-prop','s:178:\"As informações que devem ser obtidas:\n\nNote que se não for selecionado nenhum valor, o resultado irá conter texto em notação wiki mas a saída estará num formato obsoleto.\";'),('pt-br','messages:apihelp-expandtemplates-paramvalue-prop-categories','s:110:\"Quaisquer categorias existentes na entrada que não estão representadas no texto em notação wiki de saída.\";'),('pt-br','messages:apihelp-expandtemplates-paramvalue-prop-properties','s:96:\"Propriedades da página, definidas por palavras mágicas expandidas, no texto em notação wiki.\";'),('pt-br','messages:apihelp-expandtemplates-paramvalue-prop-volatile','s:86:\"Indica se o resultado é volátil e não deve ser reutilizado noutra parte da página.\";'),('pt-br','messages:apihelp-expandtemplates-paramvalue-prop-ttl','s:102:\"O período máximo a partir do qual os armazenamentos do resultado na \'\'cache\'\' devem ser invalidados.\";'),('pt-br','messages:apihelp-expandtemplates-paramvalue-prop-modules','s:273:\"Quaisquer módulos ResourceLoader que as funções do analisador sintático solicitaram que fossem adicionados ao resultado de saída. Um dos valores <kbd>jsconfigvars</kbd> ou <kbd>encodedjsconfigvars</kbd> tem de ser solicitado em conjunto com o valor <kbd>modules</kbd>.\";'),('pt-br','messages:apihelp-expandtemplates-paramvalue-prop-jsconfigvars','s:78:\"Devolve as variáveis de configuração JavaScript específicas desta página.\";'),('pt-br','messages:apihelp-expandtemplates-paramvalue-prop-encodedjsconfigvars','s:110:\"Devolve as variáveis de configuração JavaScript específicas da página, no formato de uma \'\'string\'\' JSON.\";'),('pt-br','messages:apihelp-expandtemplates-paramvalue-prop-parsetree','s:60:\"A árvore de análise sintática em XML do texto de entrada.\";'),('pt-br','messages:apihelp-expandtemplates-param-includecomments','s:62:\"Indica se devem ser incluídos comentários HTML no resultado.\";'),('pt-br','messages:apihelp-expandtemplates-param-generatexml','s:82:\"Gerar a árvore de análise sintática em XML (substituído por $1prop=parsetree).\";'),('pt-br','messages:apihelp-expandtemplates-example-simple','s:83:\"Expandir o texto em notação wiki <kbd><nowiki>{{Project:Sandbox}}</nowiki></kbd>.\";'),('pt-br','messages:apihelp-feedcontributions-param-user','s:60:\"Os utilizadores dos quais serão obtidas as contribuições.\";'),('pt-br','messages:apihelp-feedcontributions-example-simple','s:61:\"Devolver as contribuições do utilizador <kbd>Example</kbd>.\";'),('pt-br','messages:apihelp-feedrecentchanges-param-associated','s:65:\"Incluir o espaço nominal associado (de discussão ou principal).\";'),('pt-br','messages:apihelp-feedrecentchanges-param-days','s:37:\"Dias aos quais limitar os resultados.\";'),('pt-br','messages:apihelp-feedrecentchanges-param-hideanons','s:52:\"Ocultar mudanças feitas por utilizadores anónimos.\";'),('pt-br','messages:apihelp-feedrecentchanges-param-hideliu','s:53:\"Ocultar mudanças feitas por utilizadores registados.\";'),('pt-br','messages:apihelp-feedrecentchanges-param-target','s:54:\"Mostrar apenas mudanças em páginas afluentes a esta.\";'),('pt-br','messages:apihelp-feedrecentchanges-param-showlinkedto','s:72:\"Mostrar mudanças em páginas com ligações para a página selecionada.\";'),('pt-br','messages:apihelp-feedrecentchanges-param-categories','s:75:\"Mostrar apenas mudanças nas páginas que estão em todas estas categorias.\";'),('pt-br','messages:apihelp-feedrecentchanges-param-categories_any','s:76:\"Mostrar mudanças nas páginas que estão em qualquer uma destas categorias.\";'),('pt-br','messages:apihelp-feedwatchlist-example-all6hrs','s:70:\"Mostrar todas as mudanças às páginas vigiadas nas últimas 6 horas.\";'),('pt-br','messages:apihelp-help-param-modules','s:177:\"Módulos para os quais apresentar ajuda (valores dos parâmetros <var>action</var> e <var>format</var>, ou <kbd>main</kbd>). Pode-se especificar submódulos com um <kbd>+</kbd>.\";'),('pt-br','messages:apihelp-help-example-submodules','s:69:\"Ajuda para <kbd>action=query</kbd> e todos os respetivos submódulos.\";'),('pt-br','messages:apihelp-help-example-query','s:40:\"Ajuda para dois submódulos de consulta.\";'),('pt-br','messages:apihelp-imagerotate-param-tags','s:59:\"Etiquetas a aplicar à entrada no registo de carregamentos.\";'),('pt-br','messages:apihelp-import-description','s:241:\"Importar uma página de outra wiki ou de um ficheiro XML.\n\nNote que o POST do HTTP tem de ser feito como um carregamento de ficheiro (isto é, com multipart/form-data como Content-Type) ao enviar um ficheiro para o parâmetro <var>xml</var>.\";'),('pt-br','messages:apihelp-import-param-interwikisource','s:55:\"Para importações interwikis: a wiki de onde importar.\";'),('pt-br','messages:apihelp-import-param-interwikipage','s:52:\"Para importações interwikis: a página a importar.\";'),('pt-br','messages:apihelp-import-param-fullhistory','s:90:\"Para importações interwikis: importar o historial completo, não apenas a versão atual.\";'),('pt-br','messages:apihelp-import-param-templates','s:84:\"Para importações interwikis: importar também todas as predefinições incluídas.\";'),('pt-br','messages:apihelp-import-param-tags','s:119:\"Etiquetas de modificação a aplicar à entrada no registo de importações e à revisão nula nas páginas importadas.\";'),('pt-br','messages:apihelp-import-example-import','s:91:\"Importar [[meta:Help:ParserFunctions]] para o espaço nominal 100 com o historial completo.\";'),('pt-br','messages:apihelp-linkaccount-description','s:62:\"Ligar uma conta de um fornecedor terceiro ao utilizador atual.\";'),('pt-br','messages:apihelp-linkaccount-example-link','s:77:\"Iniciar o processo de ligação a uma conta do fornecedor <kbd>Example</kbd>.\";'),('pt-br','messages:apihelp-login-description','s:338:\"Entrar e obter \'\'cookies\'\' de autenticação.\n\nEsta operação só deve ser usada em combinação com [[Special:BotPasswords]]; a sua utilização para entrar com a conta principal é obsoleta e poderá falhar sem aviso. Para entrar com a conta principal de forma segura, use <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),('pt-br','messages:apihelp-login-description-nobotpasswords','s:198:\"Entrar e obter \'\'cookies\'\' de autenticação.\n\nEsta operação é obsoleta e poderá falhar sem aviso. Para entrar de forma segura, use <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),('pt-br','messages:apihelp-login-param-token','s:54:\"Chave de início de sessão obtida no primeiro pedido.\";'),('pt-br','messages:apihelp-login-example-gettoken','s:38:\"Obter uma chave de início de sessão.\";'),('pt-br','messages:apihelp-logout-description','s:48:\"Terminar a sessão e limpar os dados da sessão.\";'),('pt-br','messages:apihelp-logout-example-logout','s:39:\"Terminar a sessão do utilizador atual.\";'),('pt-br','messages:apihelp-managetags-description','s:72:\"Executar tarefas de gestão relacionadas com etiquetas de modificação.\";'),('pt-br','messages:apihelp-managetags-param-operation','s:502:\"A operação que será realizada:\n;create:Criar uma nova etiqueta de modificação para uso manual.\n;delete:Remover da base de dados uma etiqueta de modificação, incluindo remover a etiqueta de todas as revisões, entradas nas mudanças recentes e entradas do registo onde ela é utilizada.\n;activate:Ativar uma etiqueta de modificação, permitindo que os utilizadores a apliquem manualmente.\n;deactivate:Desativar uma etiqueta de modificação, impedindo que os utilizadores a apliquem manualmente.\";'),('pt-br','messages:apihelp-managetags-param-tag','s:324:\"Etiqueta a ser criada, eliminada, ativada ou desativada. Para criar uma etiqueta ela não pode existir. Para eliminar uma etiqueta, ela tem de existir. Para ativar uma etiqueta, ela tem de existir e não estar a ser utilizada por nenhuma extensão. Para desativar uma etiqueta, ela tem de estar ativa e definida manualmente.\";'),('pt-br','messages:apihelp-managetags-param-reason','s:93:\"Um motivo, opcional, para a criação, eliminação, ativação ou desativação da etiqueta.\";'),('pt-br','messages:apihelp-managetags-param-ignorewarnings','s:75:\"Indica se devem ser ignorados todos os avisos gerados durante a operação.\";'),('pt-br','messages:apihelp-managetags-param-tags','s:83:\"Etiquetas de modificação a aplicar à entrada no registo de gestão de etiquetas.\";'),('pt-br','messages:apihelp-managetags-example-create','s:94:\"Criar uma etiqueta com o nome <kbd>spam</kbd> e o motivo <kbd>For use in edit patrolling</kbd>\";'),('pt-br','messages:apihelp-managetags-example-delete','s:73:\"Eliminar a etiqueta <kbd>vandlaism</kbd> com o motivo <kbd>Misspelt</kbd>\";'),('pt-br','messages:apihelp-managetags-example-activate','s:95:\"Ativar uma etiqueta com o nome <kbd>spam</kbd> e o motivo <kbd>For use in edit patrolling</kbd>\";'),('pt-br','messages:apihelp-managetags-example-deactivate','s:90:\"Desativar uma etiqueta com o nome <kbd>spam</kbd> e o motivo <kbd>No longer required</kbd>\";'),('pt-br','messages:apihelp-mergehistory-description','s:31:\"Fundir o historial de páginas.\";'),('pt-br','messages:apihelp-mergehistory-param-from','s:105:\"Título da página cujo historial será fundido. Não pode ser usado em conjunto com <var>$1fromid</var>.\";'),('pt-br','messages:apihelp-mergehistory-param-fromid','s:109:\"Identificador da página cujo historial será fundido. Não pode ser usado em conjunto com <var>$1from</var>.\";'),('pt-br','messages:apihelp-mergehistory-param-to','s:108:\"Título da página à qual o historial será fundido. Não pode ser usado em conjunto com <var>$1toid</var>.\";'),('pt-br','messages:apihelp-mergehistory-param-toid','s:112:\"Identificador da página à qual o historial será fundido. Não pode ser usado em conjunto com <var>$1to</var>.\";'),('pt-br','messages:apihelp-mergehistory-param-timestamp','s:217:\"Data e hora até a qual as revisões serão movidas do historial da página de origem para o historial das páginas de destino. Se omitido, todo o historial da página de origem será fundido com a página de destino.\";'),('pt-br','messages:apihelp-mergehistory-param-reason','s:31:\"Motivo para fundir o historial.\";'),('pt-br','messages:apihelp-mergehistory-example-merge','s:90:\"Fundir todo o historial da página <kbd>Oldpage</kbd> com o da página <kbd>Newpage</kbd>.\";'),('pt-br','messages:apihelp-mergehistory-example-merge-timestamp','s:117:\"Fundir as revisões de <kbd>Oldpage</kbd> até à data e hora <kbd>2015-12-31T04:37:41Z</kbd> com <kbd>Newpage</kbd>.\";'),('pt-br','messages:apihelp-move-param-to','s:24:\"Novo título da página.\";'),('pt-br','messages:apihelp-move-param-reason','s:34:\"Motivo para a alteração do nome.\";'),('pt-br','messages:apihelp-move-param-watchlist','s:163:\"Adicionar ou remover incondicionalmente a página da lista de páginas vigiadas do utilizador atual, usar as preferências ou não alterar o estado de vigilância.\";'),('pt-br','messages:apihelp-move-param-tags','s:119:\"Etiquetas de modificação a aplicar à entrada no registo de movimentações e à revisão nula na página de destino.\";'),('pt-br','messages:apihelp-move-example-move','s:83:\"Mover <kbd>Badtitle</kbd> para <kbd>Goodtitle</kbd> sem deixar um redirecionamento.\";'),('pt-br','messages:apihelp-opensearch-description','s:47:\"Pesquisar a wiki usando o protocolo OpenSearch.\";'),('pt-br','messages:apihelp-opensearch-param-suggest','s:108:\"Não fazer nada se <var>[[mw:Manual:$wgEnableOpenSearchSuggest|$wgEnableOpenSearchSuggest]]</var> for falso.\";'),('pt-br','messages:apihelp-opensearch-param-redirects','s:280:\"Como tratar redirecionamentos:\n;return:Devolver o próprio redirecionamento.\n;resolve:Devolver a página de destino. Pode devolver menos de $1limit resultados.\nPor razões históricas, o valor por omissão é \"return\" para o formato $1format=json e \"resolve\" para outros formatos.\";'),('pt-br','messages:apihelp-opensearch-param-warningsaserror','s:98:\"Se forem gerados avisos com <kbd>format=json</kbd>, devolver um erro da API em vez de ignorá-los.\";'),('pt-br','messages:apihelp-options-description','s:283:\"Alterar as preferências do utilizador atual.\n\nSó podem ser definidas as opções que estão registadas no núcleo do MediaWiki ou numa das extensões instaladas, ou opções cuja chave tem o prefixo <code>userjs-</code> (que são supostas ser usadas por \'\'scripts\'\' de utilizador).\";'),('pt-br','messages:apihelp-options-param-resetkinds','s:91:\"Lista dos tipos de opções a reiniciar quando a opção <var>$1reset</var> está definida.\";'),('pt-br','messages:apihelp-options-param-change','s:453:\"Listas das alterações, na forma nome=valor (isto é, skin=vector). Se não for fornecido nenhum valor (nem sequer um sinal de igualdade), por exemplo, nomedaopção|outraopção|..., a opção será reiniciada para o seu valor por omissão. Se qualquer dos valores passados contém uma barra vertical (<kbd>|</kbd>), use um [[Special:ApiHelp/main#main/datatypes|separador alternativo para valores múltiplos]] de forma a obter o comportamento correto.\";'),('pt-br','messages:apihelp-options-param-optionname','s:89:\"O nome da opção que deve ser configurada com o valor dado por <var>$1optionvalue</var>.\";'),('pt-br','messages:apihelp-options-param-optionvalue','s:64:\"O valor para a opção especificada por <var>$1optionname</var>.\";'),('pt-br','messages:apihelp-options-example-change','s:64:\"Alterar as preferências <kbd>skin</kbd> e <kbd>hideminor</kbd>.\";'),('pt-br','messages:apihelp-paraminfo-param-modules','s:273:\"Lista dos nomes dos módulos (valores dos parâmetros <var>action</var> e <var>format</var>, ou <kbd>main</kbd>). Podem ser especificados submódulos com <kbd>+</kbd>, ou todos os submódulos com <kbd>+*</kbd>, ou todos os submódulos de forma recursiva com <kbd>+**</kbd>.\";'),('pt-br','messages:apihelp-paraminfo-param-helpformat','s:28:\"Formato dos textos de ajuda.\";'),('pt-br','messages:apihelp-paraminfo-param-querymodules','s:195:\"Lista de nomes dos módulos a consultar (valores dos parâmetros <var>prop</var>, <var>meta</var> ou <var>list</var>). Usar <kbd>$1modules=query+foo</kbd> em vez de <kbd>$1querymodules=foo</kbd>.\";'),('pt-br','messages:apihelp-paraminfo-param-mainmodule','s:124:\"Obter também informação sobre o módulo principal (do nível de topo). Em vez de usá-lo, usar <kbd>$1modules=main</kbd>.\";'),('pt-br','messages:apihelp-paraminfo-param-pagesetmodule','s:84:\"Obter também informação sobre o módulo pageset (fornecendo titles= e restantes).\";'),('pt-br','messages:apihelp-paraminfo-param-formatmodules','s:123:\"Lista de nomes de módulos de formato (valor do parâmetro <var>format</var>). Em vez de usá-lo, use <var>$1modules</var>.\";'),('pt-br','messages:apihelp-paraminfo-example-1','s:278:\"Mostrar informação para <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd>, <kbd>[[Special:ApiHelp/jsonfm|format=jsonfm]]</kbd>, <kbd>[[Special:ApiHelp/query+allpages|action=query&list=allpages]]</kbd> e <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd>.\";'),('pt-br','messages:apihelp-paraminfo-example-2','s:95:\"Mostrar informação de todos os módulos de <kbd>[[Special:ApiHelp/query|action=query]]</kbd>.\";'),('pt-br','messages:apihelp-parse-description','s:615:\"Faz a análise sintática do conteúdo e devolve o resultado da análise.\n\nConsulte os vários módulos disponíveis no parâmetro prop de <kbd>[[Special:ApiHelp/query|action=query]]</kbd> para obter informação da versão atual de uma página.\n\nHá várias formas de especificar o texto a analisar:\n# Especificar uma página ou revisão, usando <var>$1page</var>, <var>$1pageid</var> ou <var>$1oldid</var>.\n# Especificar o conteúdo de forma explícita, usando <var>$1text</var>, <var>$1title</var> e <var>$1contentmodel</var>.\n# Especificar só um resumo a analisar. <var>$1prop</var> deve receber o valor vazio.\";'),('pt-br','messages:apihelp-parse-param-title','s:139:\"Título da página à qual o texto pertence. Se omitido, é preciso especificar <var>$1contentmodel</var> e deve usar [[API]] como título.\";'),('pt-br','messages:apihelp-parse-param-text','s:108:\"Texto a analisar. Usar <var>$1title</var> ou <var>$1contentmodel</var> para controlar o modelo de conteúdo.\";'),('pt-br','messages:apihelp-parse-param-redirects','s:102:\"Se <var>$1page</var> ou <var>$1pageid</var> estiverem definidos para um redirecionamento, resolvê-lo.\";'),('pt-br','messages:apihelp-parse-param-oldid','s:100:\"Analisar o conteúdo desta revisão. Tem precedência sobre <var>$1page</var> e <var>$1pageid</var>.\";'),('pt-br','messages:apihelp-parse-paramvalue-prop-revid','s:58:\"Adiciona o identificador de revisão da página analisada.\";'),('pt-br','messages:apihelp-parse-paramvalue-prop-displaytitle','s:38:\"Adiciona o título do texto analisado.\";'),('pt-br','messages:apihelp-parse-paramvalue-prop-limitreporthtml','s:122:\"Fornece a versão HTML do relatório de limites. Não fornece dados quando <var>$1disablelimitreport</var> está definido.\";'),('pt-br','messages:apihelp-parse-paramvalue-prop-parsetree','s:98:\"A árvore de análise XML do conteúdo da revisão (requer o modelo de conteúdo <code>$1</code>).\";'),('pt-br','messages:apihelp-parse-param-pst','s:126:\"Fazer uma transformação de pré-gravação ao texto de entrada, antes de analisá-lo. Só é válido quando usado com texto.\";'),('pt-br','messages:apihelp-parse-param-onlypst','s:215:\"Fazer uma transformação de pré-gravação (PST, \'\'pre-save transform\'\') ao texto de entrada, mas não o analisar. Devolve o mesmo texto após aplicação da PST. Só é válido quando usado com <var>$1text</var>.\";'),('pt-br','messages:apihelp-parse-param-effectivelanglinks','s:102:\"Inclui links interlínguas fornecidos por extensões (para ser usado com <kbd>$1prop=langlinks</kbd>).\";'),('pt-br','messages:apihelp-parse-param-section','s:261:\"Analisar apenas o conteúdo desta secção.\n\nQuando tiver o valor <kbd>new</kbd>, analisar <var>$1text</var> e <var>$1sectiontitle</var> como se fosse adicionar uma nova secção à página.\n\n<kbd>new</kbd> só é permitido quando se especifica <var>text</var>.\";'),('pt-br','messages:apihelp-parse-param-sectiontitle','s:198:\"O novo título da secção quando <var>section</var> tem o valor <kbd>new</kbd>.\n\nAo contrário da edição de páginas, este não toma o valor de <var>summary</var> se for omitido ou estiver vazio.\";'),('pt-br','messages:apihelp-parse-param-disablelimitreport','s:102:\"Omitir o relatório de limites (\"NewPP limit report\") do resultado de saída do analisador sintático.\";'),('pt-br','messages:apihelp-parse-param-disablepp','s:51:\"Em vez deste, usar <var>$1disablelimitreport</var>.\";'),('pt-br','messages:apihelp-parse-param-disableeditsection','s:75:\"Omitir links para edição da secção no resultado da análise sintática.\";'),('pt-br','messages:apihelp-parse-param-disabletidy','s:87:\"Não fazer a limpeza do HTML (isto é, o \'\'tidy\'\') no resultado da análise sintática.\";'),('pt-br','messages:apihelp-parse-param-generatexml','s:125:\"Gerar a árvore de análise XML (requer o modelo de conteúdo <code>$1</code>; substituído por <kbd>$2prop=parsetree</kbd>).\";'),('pt-br','messages:apihelp-parse-param-preview','s:42:\"Executar a análise em modo de antevisão.\";'),('pt-br','messages:apihelp-parse-param-sectionpreview','s:79:\"Executar a análise em modo de antevisão (também ativa o modo de antevisão).\";'),('pt-br','messages:apihelp-parse-param-disabletoc','s:42:\"Omitir a tabela de conteúdo no resultado.\";'),('pt-br','messages:apihelp-parse-param-contentformat','s:108:\"O formato da seriação de conteúdo, usado para o texto de entrada. Só é válido quando usado com $1text.\";'),('pt-br','messages:apihelp-parse-param-contentmodel','s:187:\"Modelo de conteúdo do texto de entrada. Se omitido, $1title tem de ser especificado e o valor por omissão será o modelo do título especificado. Só é válido quando usado com $1text.\";'),('pt-br','messages:apihelp-patrol-param-tags','s:84:\"Etiquetas de modificação a aplicar à entrada no registo de edições patrulhadas.\";'),('pt-br','messages:apihelp-protect-param-protections','s:300:\"Lista de níveis de proteção, na forma <kbd>action=level</kbd> (por exemplo, <kbd>edit=sysop</kbd>). O nível <kbd>all</kbd> significada que todos podem executar a operação, isto é, sem restrição.\n\n<strong>Nota:</strong> Serão removidas as restrições de quaisquer operações não listadas.\";'),('pt-br','messages:apihelp-protect-param-expiry','s:227:\"Datas e horas de expiração. Se só uma data e hora for definida, será usada para todas as proteções. Use <kbd>infinite</kbd>, <kbd>indefinite</kbd>, <kbd>infinity</kbd> ou <kbd>never</kbd>, para proteção sem expiração.\";'),('pt-br','messages:apihelp-protect-param-tags','s:74:\"Etiquetas de modificação a aplicar à entrada no registo de proteções.\";'),('pt-br','messages:apihelp-protect-param-cascade','s:203:\"Ativar a proteção em cascata (isto é, proteger as predefinições transcluídas e as imagens usadas nesta página). Ignorado se nenhum dos níveis de proteção dados suportam a proteção em cascata.\";'),('pt-br','messages:apihelp-protect-param-watch','s:117:\"Se definido, adicionar a página que está a ser protegida ou desprotegida às páginas vigiadas do utilizador atual.\";'),('pt-br','messages:apihelp-protect-param-watchlist','s:163:\"Adicionar ou remover incondicionalmente a página da lista de páginas vigiadas do utilizador atual, usar as preferências ou não alterar o estado de vigilância.\";'),('pt-br','messages:apihelp-query-description','s:192:\"Obter dados do MediaWiki e acerca dele.\n\nTodas as modificações de dados têm primeiro que usar um pedido para adquirir uma chave, de forma a impedir ações abusivas de \'\'sites\'\' maliciosos.\";'),('pt-br','messages:apihelp-query-param-indexpageids','s:118:\"Incluir uma secção adicional de identificadores de página que lista todos os identificadores de página devolvidos.\";'),('pt-br','messages:apihelp-query-param-export','s:72:\"Exportar as revisões atuais de todas as páginas fornecidas ou geradas.\";'),('pt-br','messages:apihelp-query-param-exportnowrap','s:139:\"Devolver o XML de exportação sem envolvê-lo num resultado XML (o mesmo formato que [[Special:Export]]). Só pode ser usado com $1export.\";'),('pt-br','messages:apihelp-query-param-iwurl','s:84:\"Indica se deve ser obtido o URL completo quando o título é um \'\'link\'\' interwikis.\";'),('pt-br','messages:apihelp-query-param-rawcontinue','s:73:\"Devolver os dados em bruto de <samp>query-continue</samp> para continuar.\";'),('pt-br','messages:apihelp-query-example-revisions','s:149:\"Obter [[Special:ApiHelp/query+siteinfo|informação do \'\'site\'\']] e as [[Special:ApiHelp/query+revisions|revisões]] da página <kbd>Main Page</kbd>.\";'),('pt-br','messages:apihelp-query-example-allpages','s:65:\"Obter as revisões das páginas que começam por <kbd>API/</kbd>.\";'),('pt-br','messages:apihelp-query+allcategories-param-from','s:60:\"A categoria a partir da qual será começada a enumeração.\";'),('pt-br','messages:apihelp-query+allcategories-param-to','s:51:\"A categoria na qual será terminada a enumeração.\";'),('pt-br','messages:apihelp-query+allcategories-paramvalue-prop-size','s:44:\"Adiciona o número de páginas na categoria.\";'),('pt-br','messages:apihelp-query+allcategories-paramvalue-prop-hidden','s:72:\"Etiqueta as categorias ocultadas com <code>_&#95;HIDDENCAT_&#95;</code>.\";'),('pt-br','messages:apihelp-query+allcategories-example-generator','s:110:\"Obter informação sobre a própria página de categoria, para as categorias que começam por <kbd>List</kbd>.\";'),('pt-br','messages:apihelp-query+alldeletedrevisions-param-miser-user-namespace','s:291:\"<strong>Nota:</strong> Devido ao [[mw:Manual:$wgMiserMode|modo avarento]], o uso de <var>$1user</var> e <var>$1namespace</var> em conjunto pode resultar na devolução de menos de <var>$1limit</var> resultados antes de continuar; em casos extremos pode não ser devolvido qualquer resultado.\";'),('pt-br','messages:apihelp-query+alldeletedrevisions-param-generatetitles','s:81:\"Ao ser usado como gerador, gerar títulos em vez de identificadores de revisões.\";'),('pt-br','messages:apihelp-query+allfileusages-param-prefix','s:67:\"Procurar todos os títulos de ficheiro que começam por este valor.\";'),('pt-br','messages:apihelp-query+allfileusages-param-unique','s:169:\"Mostrar só nomes de ficheiro únicos. Não pode ser usado com <kbd>$1prop=ids</kbd>.\nAo ser usado como gerador, produz páginas de destino em vez de páginas de origem.\";'),('pt-br','messages:apihelp-query+allfileusages-paramvalue-prop-ids','s:100:\"Adiciona os identificadores das páginas que utilizam (não pode ser usado com <var>$1unique</var>).\";'),('pt-br','messages:apihelp-query+allfileusages-example-B','s:141:\"Listar os títulos de ficheiros, incluindo aqueles em falta, com os identificadores das páginas de onde provêm, começando no <kbd>B</kbd>.\";'),('pt-br','messages:apihelp-query+allfileusages-example-unique-generator','s:65:\"Obtém todos os títulos de ficheiros, marcando aqueles em falta.\";'),('pt-br','messages:apihelp-query+allimages-description','s:42:\"Enumerar todas as imagens sequencialmente.\";'),('pt-br','messages:apihelp-query+allimages-param-sort','s:42:\"Propriedade pela qual fazer a ordenação.\";'),('pt-br','messages:apihelp-query+allimages-param-from','s:104:\"O título da imagem a partir do qual será começada a enumeração. Só pode ser usado com $1sort=name.\";'),('pt-br','messages:apihelp-query+allimages-param-to','s:95:\"O título da imagem no qual será terminada a enumeração. Só pode ser usado com $1sort=name.\";'),('pt-br','messages:apihelp-query+allimages-param-start','s:113:\"A data e hora da imagem a partir da qual será começada a enumeração. Só pode ser usado com $1sort=timestamp.\";'),('pt-br','messages:apihelp-query+allimages-param-end','s:104:\"A data e hora da imagem na qual será terminada a enumeração. Só pode ser usado com $1sort=timestamp.\";'),('pt-br','messages:apihelp-query+allimages-param-prefix','s:101:\"Procurar todos os títulos de imagem que começam por este valor. Só pode ser usado com $1sort=name.\";'),('pt-br','messages:apihelp-query+allimages-param-minsize','s:58:\"Limitar só às imagens com este número mínimo de bytes.\";'),('pt-br','messages:apihelp-query+allimages-param-maxsize','s:58:\"Limitar só às imagens com este número máximo de bytes.\";'),('pt-br','messages:apihelp-query+allimages-param-sha1','s:74:\"Resumo criptográfico SHA1 da imagem. Tem precedência sobre $1sha1base36.\";'),('pt-br','messages:apihelp-query+allimages-param-sha1base36','s:69:\"Resumo criptográfico SHA1 da imagem em base 36 (usado no MediaWiki).\";'),('pt-br','messages:apihelp-query+alllinks-param-unique','s:168:\"Mostrar só títulos ligados únicos. Não pode ser usado com <kbd>$1prop=ids</kbd>.\nAo ser usado como gerador, produz páginas de destino em vez de páginas de origem.\";'),('pt-br','messages:apihelp-query+alllinks-paramvalue-prop-ids','s:106:\"Adiciona o identificador da página que contém a ligação (não pode ser usado com <var>$1unique</var>).\";'),('pt-br','messages:apihelp-query+alllinks-paramvalue-prop-title','s:31:\"Adiciona o título do \'\'link\'\'.\";'),('pt-br','messages:apihelp-query+alllinks-example-B','s:191:\"Listar os títulos para os quais existem ligações, incluindo títulos em falta, com os identificadores das páginas que contêm as respetivas ligações, começando pela letra <kbd>B</kbd>.\";'),('pt-br','messages:apihelp-query+alllinks-example-unique','s:60:\"Listar os títulos únicos para os quais existem ligações.\";'),('pt-br','messages:apihelp-query+alllinks-example-unique-generator','s:85:\"Obtém todos os títulos para os quais existem ligações, marcando aqueles em falta.\";'),('pt-br','messages:apihelp-query+allmessages-param-messages','s:108:\"Mensagens a serem produzidas no resultado. <kbd>*</kbd> (o valor por omissão) significa todas as mensagens.\";'),('pt-br','messages:apihelp-query+allmessages-param-enableparser','s:165:\"Definir, para ativar o analisador sintático e pré-processar o texto da mensagem com notação wiki (substituir palavras mágicas, processar predefinições, etc.).\";'),('pt-br','messages:apihelp-query+allmessages-param-nocontent','s:75:\"Se definido, não incluir o conteúdo das mensagens no resultado de saída.\";'),('pt-br','messages:apihelp-query+allmessages-param-includelocal','s:335:\"Incluir também as mensagens locais, isto é, mensagens que não existem no software mas existem como uma página no espaço nominal {{ns:MediaWiki}}.\nIsto lista todas as páginas do espaço nominal {{ns:MediaWiki}}, portanto, também irá listar aquelas que não são verdadeiramente mensagens, como [[MediaWiki:Common.js|Common.js]].\";'),('pt-br','messages:apihelp-query+allmessages-param-args','s:48:\"Os argumentos a serem substituídos na mensagem.\";'),('pt-br','messages:apihelp-query+allmessages-param-filter','s:57:\"Devolver só as mensagens cujos nomes contêm este texto.\";'),('pt-br','messages:apihelp-query+allmessages-param-title','s:116:\"Nome da página a utilizar como contexto ao fazer a análise sintática da mensagem (para a opção $1enableparser).\";'),('pt-br','messages:apihelp-query+allmessages-example-de','s:72:\"Mostrar as mensagens <kbd>august</kbd> e <kbd>mainpage</kbd> em Alemão.\";'),('pt-br','messages:apihelp-query+allpages-description','s:77:\"Enumerar sequencialmente todas as páginas de um determinado espaço nominal.\";'),('pt-br','messages:apihelp-query+allpages-param-from','s:69:\"O título de página a partir do qual será começada a enumeração.\";'),('pt-br','messages:apihelp-query+allpages-param-to','s:60:\"O título de página no qual será terminada a enumeração.\";'),('pt-br','messages:apihelp-query+allpages-param-prefix','s:66:\"Procurar todos os títulos de páginas que comecem com este valor.\";'),('pt-br','messages:apihelp-query+allpages-param-prtype','s:36:\"Limitar só às páginas protegidas.\";'),('pt-br','messages:apihelp-query+allpages-param-prlevel','s:102:\"Filtrar as proteções com base no nível de proteção (tem de ser usado com o parâmetro $1prtype=).\";'),('pt-br','messages:apihelp-query+allpages-param-prfiltercascade','s:102:\"Filtrar as proteções com base na proteção em cascata (ignorado se $1prtype não estiver presente).\";'),('pt-br','messages:apihelp-query+allpages-param-filterlanglinks','s:159:\"Filtrar dependo de uma página ter \'\'links\'\' interlínguas. Note que isto pode não tomar em consideração \'\'links\'\' interlínguas adicionados por extensões.\";'),('pt-br','messages:apihelp-query+allpages-param-prexpiry','s:277:\"O tipo de expiração pelo qual as páginas serão filtradas:\n;indefinite:Obter só páginas com um período de expiração indefinido.\n;definite:Obter só páginas com um período de expiração definido (específico).\n;all:Obter páginas com qualquer período de expiração.\";'),('pt-br','messages:apihelp-query+allpages-example-B','s:64:\"Mostrar uma lista de páginas, começando na letra <kbd>B</kbd>.\";'),('pt-br','messages:apihelp-query+allpages-example-generator','s:72:\"Mostrar informação sobre 4 páginas, começando na letra <kbd>T</kbd>.\";'),('pt-br','messages:apihelp-query+allpages-example-generator-revisions','s:115:\"Mostrar o conteúdo das primeiras 2 páginas que não sejam redirecionamentos, começando na página <kbd>Re</kbd>.\";'),('pt-br','messages:apihelp-query+allredirects-param-prefix','s:66:\"Procurar todas as páginas de destino que começam por este valor.\";'),('pt-br','messages:apihelp-query+allredirects-param-unique','s:190:\"Mostrar só páginas de destino únicas. Não pode ser usado com <kbd>$1prop=ids|fragment|interwiki</kbd>.\nAo ser usado como gerador, produz páginas de destino em vez de páginas de origem.\";'),('pt-br','messages:apihelp-query+allredirects-paramvalue-prop-ids','s:113:\"Adiciona o identificador da página que contém o redirecionamento (não pode ser usado com <var>$1unique</var>).\";'),('pt-br','messages:apihelp-query+allredirects-paramvalue-prop-title','s:39:\"Adiciona o título do redirecionamento.\";'),('pt-br','messages:apihelp-query+allredirects-paramvalue-prop-fragment','s:99:\"Adiciona o fragmento do redirecionamento, se existir (não pode ser usado com <var>$1unique</var>).\";'),('pt-br','messages:apihelp-query+allredirects-paramvalue-prop-interwiki','s:120:\"Adiciona o prefixo interwikis do redirecionamento, se existir (não pode ser usado em conjunto com <var>$1unique</var>).\";'),('pt-br','messages:apihelp-query+allredirects-example-B','s:131:\"Listar as páginas de destino, incluindo aquelas em falta, com os identificadores da página de origem, começando na <kbd>B</kbd>.\";'),('pt-br','messages:apihelp-query+allredirects-example-unique','s:38:\"Listar as páginas de destino únicas.\";'),('pt-br','messages:apihelp-query+allredirects-example-unique-generator','s:63:\"Obtém todas as páginas de destino, marcando aquelas em falta.\";'),('pt-br','messages:apihelp-query+allredirects-example-generator','s:52:\"Obtém as páginas que contêm os redirecionamentos.\";'),('pt-br','messages:apihelp-query+allrevisions-param-start','s:62:\"A data e hora a partir da qual será começada a enumeração.\";'),('pt-br','messages:apihelp-query+allrevisions-param-end','s:53:\"A data e hora na qual será terminada a enumeração.\";'),('pt-br','messages:apihelp-query+allrevisions-param-user','s:41:\"Listar só as revisões deste utilizador.\";'),('pt-br','messages:apihelp-query+allrevisions-param-excludeuser','s:42:\"Não listar as revisões deste utilizador.\";'),('pt-br','messages:apihelp-query+allrevisions-param-namespace','s:45:\"Listar só as páginas neste espaço nominal.\";'),('pt-br','messages:apihelp-query+allrevisions-param-generatetitles','s:81:\"Ao ser usado como gerador, gerar títulos em vez de identificadores de revisões.\";'),('pt-br','messages:apihelp-query+allrevisions-example-user','s:71:\"Listar as últimas 50 contribuições do utilizador <kbd>Example</kbd>.\";'),('pt-br','messages:apihelp-query+allrevisions-example-ns-main','s:62:\"Listar as primeiras 50 revisões no espaço nominal principal.\";'),('pt-br','messages:apihelp-query+mystashedfiles-description','s:94:\"Obter uma lista dos ficheiros que estão na área de ficheiros escondidos do utilizador atual.\";'),('pt-br','messages:apihelp-query+mystashedfiles-param-prop','s:50:\"As propriedades a serem obtidas para os ficheiros.\";'),('pt-br','messages:apihelp-query+mystashedfiles-paramvalue-prop-size','s:54:\"Obter o tamanho do ficheiro e as dimensões da imagem.\";'),('pt-br','messages:apihelp-query+mystashedfiles-paramvalue-prop-type','s:54:\"Obter o tipo MIME e o tipo de multimédia do ficheiro.\";'),('pt-br','messages:apihelp-query+mystashedfiles-example-simple','s:113:\"Obter a chave, o tamanho e as dimensões em píxeis dos ficheiros na área de ficheiros escondidos do utilizador.\";'),('pt-br','messages:apihelp-query+alltransclusions-description','s:126:\"Listar todas as transclusões (páginas incorporadas utilizando &#123;&#123;x&#125;&#125;), incluindo as que estejam em falta.\";'),('pt-br','messages:apihelp-query+alltransclusions-param-from','s:74:\"O título da transclusão a partir do qual será começada a enumeração.\";'),('pt-br','messages:apihelp-query+alltransclusions-param-to','s:65:\"O título da transclusão no qual será terminada a enumeração.\";'),('pt-br','messages:apihelp-query+alltransclusions-param-prefix','s:69:\"Procurar todos os títulos transcluídos que começam por este valor.\";'),('pt-br','messages:apihelp-query+alltransclusions-param-unique','s:174:\"Mostrar só títulos transcluídos únicos. Não pode ser usado com <kbd>$1prop=ids</kbd>.\nAo ser usado como gerador, produz páginas de destino em vez de páginas de origem.\";'),('pt-br','messages:apihelp-query+alltransclusions-paramvalue-prop-ids','s:111:\"Adiciona o identificador da página onde é feita a transclusão (não pode ser usado com <var>$1unique</var>).\";'),('pt-br','messages:apihelp-query+alltransclusions-paramvalue-prop-title','s:35:\"Adiciona o título da transclusão.\";'),('pt-br','messages:apihelp-query+alltransclusions-example-B','s:136:\"Listar os títulos transcluídos, incluindo aqueles em falta, com os identificadores das páginas de origem, começando no <kbd>B</kbd>.\";'),('pt-br','messages:apihelp-query+alltransclusions-example-unique','s:41:\"Listar os títulos transcluídos únicos.\";'),('pt-br','messages:apihelp-query+alltransclusions-example-unique-generator','s:66:\"Obtém todos os títulos transcluídos, marcando aqueles em falta.\";'),('pt-br','messages:apihelp-query+alltransclusions-example-generator','s:48:\"Obtém as páginas que contêm as transclusões.\";'),('pt-br','messages:apihelp-query+allusers-description','s:42:\"Enumerar todos os utilizadores registados.\";'),('pt-br','messages:apihelp-query+allusers-param-from','s:69:\"O nome de utilizador a partir do qual será começada a enumeração.\";'),('pt-br','messages:apihelp-query+allusers-param-to','s:60:\"O nome de utilizador no qual será terminada a enumeração.\";'),('pt-br','messages:apihelp-query+allusers-param-prefix','s:66:\"Procurar todos os nomes de utilizador que começam por este valor.\";'),('pt-br','messages:apihelp-query+allusers-param-dir','s:27:\"A direção da ordenação.\";'),('pt-br','messages:apihelp-query+allusers-param-group','s:49:\"Incluir só os utilizadores nos grupos indicados.\";'),('pt-br','messages:apihelp-query+allusers-param-excludegroup','s:45:\"Excluir os utilizadores nos grupos indicados.\";'),('pt-br','messages:apihelp-query+allusers-param-rights','s:187:\"Incluir só os utilizadores com as permissões indicadas. Não inclui as permissões atribuídas por grupos implícitos ou de promoção automática como *, utilizador, ou autoconfirmado.\";'),('pt-br','messages:apihelp-query+allusers-paramvalue-prop-blockinfo','s:62:\"Adiciona a informação sobre um bloqueio atual do utilizador.\";'),('pt-br','messages:apihelp-query+allusers-paramvalue-prop-groups','s:129:\"Lista os grupos a que o utilizador pertence. Isto usa mais recursos do servidor e pode devolver menos resultados do que o limite.\";'),('pt-br','messages:apihelp-query+allusers-paramvalue-prop-implicitgroups','s:71:\"Lista todos os grupos a que o utilizador pertence de forma automática.\";'),('pt-br','messages:apihelp-query+allusers-paramvalue-prop-rights','s:42:\"Lista as permissões que o utilizador tem.\";'),('pt-br','messages:apihelp-query+allusers-paramvalue-prop-editcount','s:47:\"Adiciona a contagem de edições do utilizador.\";'),('pt-br','messages:apihelp-query+allusers-paramvalue-prop-registration','s:91:\"Adiciona a data e hora de registo do utilizador, se estiver disponível (pode estar vazia).\";'),('pt-br','messages:apihelp-query+allusers-paramvalue-prop-centralids','s:100:\"Adiciona os identificadores centrais e o estado de ligação central (\'\'attachment\'\') do utilizador.\";'),('pt-br','messages:apihelp-query+allusers-param-witheditsonly','s:52:\"Listar só os utilizadores que realizaram edições.\";'),('pt-br','messages:apihelp-query+allusers-param-activeusers','s:84:\"Listar só os utilizadores ativos {{PLURAL:$1|no último dia|nos últimos $1 dias}}.\";'),('pt-br','messages:apihelp-query+allusers-param-attachedwiki','s:124:\"Com <kbd>$1prop=centralids</kbd>, indicar também se o utilizador tem ligação com a wiki designada por este identificador.\";'),('pt-br','messages:apihelp-query+allusers-example-Y','s:50:\"Listar utilizadores, começando pelo <kbd>Y</kbd>.\";'),('pt-br','messages:apihelp-query+authmanagerinfo-description','s:58:\"Obter informação sobre o atual estado de autenticação.\";'),('pt-br','messages:apihelp-query+authmanagerinfo-param-securitysensitiveoperation','s:133:\"Testar se o estado atual de autenticação do utilizador é suficiente para a operação especificada, que exige condições seguras.\";'),('pt-br','messages:apihelp-query+authmanagerinfo-param-requestsfor','s:125:\"Obter informação sobre os pedidos de autenticação que são necessários para a operação de autenticação especificada.\";'),('pt-br','messages:apihelp-query+authmanagerinfo-example-login','s:61:\"Obter os pedidos que podem ser usados ao iniciar uma sessão.\";'),('pt-br','messages:apihelp-query+authmanagerinfo-example-login-merged','s:87:\"Obter os pedidos que podem ser usados ao iniciar uma sessão, com os campos combinados.\";'),('pt-br','messages:apihelp-query+authmanagerinfo-example-securitysensitiveoperation','s:74:\"Testar se a autenticação é suficiente para a operação <kbd>foo</kbd>.\";'),('pt-br','messages:apihelp-query+backlinks-description','s:75:\"Encontrar todas as páginas que contêm ligações para a página indicada.\";'),('pt-br','messages:apihelp-query+backlinks-param-filterredir','s:159:\"Como filtrar os redirecionamentos. Se definido como <kbd>nonredirects</kbd> quando <var>$1redirect</var> está ativado, isto só é aplicado ao segundo nível.\";'),('pt-br','messages:apihelp-query+backlinks-param-limit','s:217:\"O número total de páginas a serem devolvidas. Se <var>$1redirect</var> estiver ativado, o limite aplica-se a cada nível em separado (o que significa que até 2 * <var>$1limit</var> resultados podem ser devolvidos).\";'),('pt-br','messages:apihelp-query+backlinks-param-redirect','s:188:\"Se a página que contém a ligação é um redirecionamento, procurar também todas as páginas que contêm ligações para esse redirecionamento. O limite máximo é reduzido para metade.\";'),('pt-br','messages:apihelp-query+backlinks-example-simple','s:48:\"Mostrar as ligações para <kbd>Main page</kbd>.\";'),('pt-br','messages:apihelp-query+backlinks-example-generator','s:79:\"Obter informações sobre as páginas com ligações para <kbd>Main page</kbd>.\";'),('pt-br','messages:apihelp-query+blocks-description','s:56:\"Listar todos os utilizadores e endereços IP bloqueados.\";'),('pt-br','messages:apihelp-query+blocks-param-start','s:62:\"A data e hora a partir da qual será começada a enumeração.\";'),('pt-br','messages:apihelp-query+blocks-param-end','s:53:\"A data e hora na qual será terminada a enumeração.\";'),('pt-br','messages:apihelp-query+blocks-param-ids','s:67:\"Lista dos identificadores de bloqueios a serem listados (opcional).\";'),('pt-br','messages:apihelp-query+blocks-param-users','s:53:\"Lista dos utilizadores a serem procurados (opcional).\";'),('pt-br','messages:apihelp-query+blocks-param-limit','s:40:\"O número máximo de bloqueios a listar.\";'),('pt-br','messages:apihelp-query+blocks-paramvalue-prop-id','s:37:\"Adiciona o identificador do bloqueio.\";'),('pt-br','messages:apihelp-query+blocks-paramvalue-prop-user','s:40:\"Adiciona o nome do utilizador bloqueado.\";'),('pt-br','messages:apihelp-query+blocks-paramvalue-prop-userid','s:49:\"Adiciona o identificador do utilizador bloqueado.\";'),('pt-br','messages:apihelp-query+blocks-paramvalue-prop-by','s:49:\"Adiciona o nome do utilizador que fez o bloqueio.\";'),('pt-br','messages:apihelp-query+blocks-paramvalue-prop-byid','s:58:\"Adiciona o identificador do utilizador que fez o bloqueio.\";'),('pt-br','messages:apihelp-query+blocks-paramvalue-prop-timestamp','s:51:\"Adiciona a data e hora de realização do bloqueio.\";'),('pt-br','messages:apihelp-query+blocks-paramvalue-prop-expiry','s:50:\"Adiciona a data e hora de expiração do bloqueio.\";'),('pt-br','messages:apihelp-query+blocks-paramvalue-prop-reason','s:46:\"Adiciona o motivo apresentado para o bloqueio.\";'),('pt-br','messages:apihelp-query+blocks-paramvalue-prop-range','s:60:\"Adiciona o intervalo de endereços IP afetado pelo bloqueio.\";'),('pt-br','messages:apihelp-query+blocks-paramvalue-prop-flags','s:52:\"Etiqueta o bloqueio com (autoblock, anononly, etc.).\";'),('pt-br','messages:apihelp-query+blocks-param-show','s:157:\"Mostrar só os bloqueios que preenchem estes critérios.\nPor exemplo, para ver só bloqueios indefinidos de endereços IP, defina <kbd>$1show=ip|!temp</kbd>.\";'),('pt-br','messages:apihelp-query+blocks-example-simple','s:17:\"Listar bloqueios.\";'),('pt-br','messages:apihelp-query+blocks-example-users','s:71:\"Listar os bloqueios dos utilizadores <kbd>Alice</kbd> e <kbd>Bob</kbd>.\";'),('pt-br','messages:apihelp-query+categories-description','s:59:\"Listar todas as categorias às quais as páginas pertencem.\";'),('pt-br','messages:apihelp-query+categories-param-prop','s:69:\"As propriedades adicionais que devem ser obtidas para cada categoria:\";'),('pt-br','messages:apihelp-query+categories-paramvalue-prop-sortkey','s:123:\"Adiciona a chave de ordenação (\'\'string\'\' hexadecimal) e o prefixo da chave de ordenação (parte legível) da categoria.\";'),('pt-br','messages:apihelp-query+categories-paramvalue-prop-timestamp','s:56:\"Adiciona a data e hora a que a categoria foi adicionada.\";'),('pt-br','messages:apihelp-query+categories-paramvalue-prop-hidden','s:83:\"Etiqueta as categorias que estão ocultadas com <code>_&#95;HIDDENCAT_&#95;</code>.\";'),('pt-br','messages:apihelp-query+categories-param-show','s:44:\"Os tipos de categorias que serão mostrados.\";'),('pt-br','messages:apihelp-query+categories-param-categories','s:110:\"Listar só estas categorias. Útil para verificar se uma determinada página está numa determinada categoria.\";'),('pt-br','messages:apihelp-query+categories-example-simple','s:87:\"Obter uma lista das categorias às quais pertence a página <kbd>Albert Einstein</kbd>.\";'),('pt-br','messages:apihelp-query+categories-example-generator','s:90:\"Obter informação sobre todas as categorias usadas na página <kbd>Albert Einstein</kbd>.\";'),('pt-br','messages:apihelp-query+categoryinfo-description','s:51:\"Devolve informação sobre as categorias indicadas.\";'),('pt-br','messages:apihelp-query+categoryinfo-example-simple','s:76:\"Obter informações sobre <kbd>Category:Foo</kbd> e <kbd>Category:Bar</kbd>.\";'),('pt-br','messages:apihelp-query+categorymembers-paramvalue-prop-ids','s:36:\"Adiciona o identificador da página.\";'),('pt-br','messages:apihelp-query+categorymembers-paramvalue-prop-title','s:67:\"Adiciona o título e o identificador do espaço nominal da página.\";'),('pt-br','messages:apihelp-query+categorymembers-paramvalue-prop-sortkey','s:80:\"Adiciona a chave usada para a ordenação da categoria (\'\'string\'\' hexadecimal).\";'),('pt-br','messages:apihelp-query+categorymembers-paramvalue-prop-sortkeyprefix','s:107:\"Adiciona o prefixo da chave usada para a ordenação da categoria (parte legível da chave de ordenação).\";'),('pt-br','messages:apihelp-query+categorymembers-paramvalue-prop-type','s:113:\"Adiciona o tipo com que a página foi categorizada (<samp>page</samp>, <samp>subcat</samp> ou <samp>file</samp>).\";'),('pt-br','messages:apihelp-query+categorymembers-paramvalue-prop-timestamp','s:47:\"Adiciona a data e hora de inclusão da página.\";'),('pt-br','messages:apihelp-query+categorymembers-param-namespace','s:172:\"Incluir só as páginas destes espaços nominais. Note que pode usar <kbd>$1type=subcat</kbd> ou <kbd>$1type=file</kbd> em vez de <kbd>$1namespace=14</kbd> ou <kbd>6</kbd>.\";'),('pt-br','messages:apihelp-query+categorymembers-param-type','s:114:\"O tipo de membros de categoria que devem ser incluídos. Ignorado se <kbd>$1sort=timestamp</kbd> estiver definido.\";'),('pt-br','messages:apihelp-query+categorymembers-param-limit','s:49:\"O número máximo de páginas a serem devolvidas.\";'),('pt-br','messages:apihelp-query+categorymembers-param-sort','s:42:\"Propriedade pela qual fazer a ordenação.\";'),('pt-br','messages:apihelp-query+categorymembers-param-start','s:133:\"A data e hora da página a partir da qual será começada a listagem. Só pode ser usado em conjunto com <kbd>$1sort=timestamp</kbd>.\";'),('pt-br','messages:apihelp-query+categorymembers-param-end','s:124:\"A data e hora da página na qual será terminada a listagem. Só pode ser usado em conjunto com <kbd>$1sort=timestamp</kbd>.\";'),('pt-br','messages:apihelp-query+categorymembers-param-starthexsortkey','s:163:\"A chave de ordenação a partir da qual a listagem será começada, como devolvida por <kbd>$1prop=sortkey</kbd>. Só pode ser usado com <kbd>$1sort=sortkey</kbd>.\";'),('pt-br','messages:apihelp-query+categorymembers-param-endhexsortkey','s:154:\"A chave de ordenação na qual a listagem será terminada, como devolvida por <kbd>$1prop=sortkey</kbd>. só pode ser usado com <kbd>$1sort=sortkey</kbd>.\";'),('pt-br','messages:apihelp-query+categorymembers-param-startsortkeyprefix','s:181:\"O prefixo da chave de ordenação a partir do qual a listagem será começada. Só pode ser usado com <kbd>$1sort=sortkey</kbd>. Tem precedência sobre <var>$1starthexsortkey</var>.\";'),('pt-br','messages:apihelp-query+categorymembers-param-endsortkeyprefix','s:272:\"O prefixo da chave de ordenação <strong>antes</strong> do qual a listagem será terminada (não <strong>no</strong> qual; se este valor ocorrer não será incluído!). Só pode ser usado com <kbd>$1sort=sortkey</kbd>. Tem precedência sobre <var>$1starthexsortkey</var>.\";'),('pt-br','messages:apihelp-query+categorymembers-param-startsortkey','s:36:\"Em vez dele, usar $1starthexsortkey.\";'),('pt-br','messages:apihelp-query+categorymembers-param-endsortkey','s:34:\"Em vez dele, usar $1endhexsortkey.\";'),('pt-br','messages:apihelp-query+categorymembers-example-simple','s:72:\"Obter as primeiras 10 páginas na categoria <kbd>Category:Physics</kbd>.\";'),('pt-br','messages:apihelp-query+categorymembers-example-generator','s:92:\"Obter informações sobre as primeiras 10 páginas na categoria <kbd>Category:Physics</kbd>.\";'),('pt-br','messages:apihelp-query+contributors-description','s:102:\"Obter a lista do contribuidores autenticados e a contagem dos contribuidores anónimos de uma página.\";'),('pt-br','messages:apihelp-query+contributors-param-group','s:151:\"Incluir só os utilizadores nos grupos indicados. Não inclui os grupos implícitos ou de promoção automática como *, utilizador, ou autoconfirmado.\";'),('pt-br','messages:apihelp-query+contributors-param-excludegroup','s:147:\"Excluir os utilizadores nos grupos indicados. Não inclui os grupos implícitos ou de promoção automática como *, utilizador, ou autoconfirmado.\";'),('pt-br','messages:apihelp-query+contributors-param-rights','s:187:\"Incluir só os utilizadores com as permissões indicadas. Não inclui as permissões atribuídas por grupos implícitos ou de promoção automática como *, utilizador, ou autoconfirmado.\";'),('pt-br','messages:apihelp-query+contributors-param-excluderights','s:183:\"Excluir os utilizadores com as permissões indicadas. Não inclui as permissões atribuídas por grupos implícitos ou de promoção automática como *, utilizador, ou autoconfirmado.\";'),('pt-br','messages:apihelp-query+contributors-example-simple','s:58:\"Mostrar os contribuidores da página <kbd>Main Page</kbd>.\";'),('pt-br','messages:apihelp-query+deletedrevisions-description','s:396:\"Obter informações sobre as revisões eliminadas.\n\nPode ser usado de várias maneiras:\n# Obter as revisões eliminadas para um conjunto de páginas, definindo títulos ou identificadores de página. Ordenados por título e data e hora.\n# Obter dados sobre um conjunto de revisões eliminadas definindo os respetivos ids: com identificadores de revisão. Ordenados pelo identificador de revisão.\";'),('pt-br','messages:apihelp-query+deletedrevisions-param-start','s:138:\"A data e hora da revisão a partir da qual será começada a enumeração. Ignorado ao processar uma lista de identificadores de revisão.\";'),('pt-br','messages:apihelp-query+deletedrevisions-param-end','s:129:\"A data e hora da revisão na qual será terminada a enumeração. Ignorado ao processar uma lista de identificadores de revisão.\";'),('pt-br','messages:apihelp-query+deletedrevisions-param-tag','s:51:\"Listar só as revisões marcadas com esta etiqueta.\";'),('pt-br','messages:apihelp-query+deletedrevisions-param-user','s:41:\"Listar só as revisões deste utilizador.\";'),('pt-br','messages:apihelp-query+deletedrevisions-param-excludeuser','s:42:\"Não listar as revisões deste utilizador.\";'),('pt-br','messages:apihelp-query+deletedrevisions-example-titles','s:110:\"Listar as revisões eliminadas das páginas <kbd>Main Page</kbd> e <kbd>Talk:Main Page</kbd>, com o conteúdo.\";'),('pt-br','messages:apihelp-query+deletedrevisions-example-revids','s:62:\"Listar a informação da revisão eliminada <kbd>123456</kbd>.\";'),('pt-br','messages:apihelp-query+deletedrevs-description','s:487:\"Listar as revisões eliminadas.\n\nOpera em três modos:\n# Listar as revisões eliminadas dos títulos indicados, ordenadas por data e hora.\n# Listar as contribuições eliminadas do utilizador indicado, ordenadas por data e hora (sem especificar títulos).\n# Listar todas as revisões eliminadas no espaço nominal indicado, ordenadas por título e por data e hora (sem especificar títulos, sem definir $1user).\n\nAlguns parâmetros só se aplicam a alguns modos e são ignorados noutros.\";'),('pt-br','messages:apihelp-query+deletedrevs-paraminfo-modes','s:28:\"{{PLURAL:$1|Modo|Modos}}: $2\";'),('pt-br','messages:apihelp-query+deletedrevs-param-start','s:74:\"A data e hora da revisão a partir da qual será começada a enumeração.\";'),('pt-br','messages:apihelp-query+deletedrevs-param-end','s:65:\"A data e hora da revisão na qual será terminada a enumeração.\";'),('pt-br','messages:apihelp-query+deletedrevs-param-from','s:34:\"Começar a listagem neste título.\";'),('pt-br','messages:apihelp-query+deletedrevs-param-to','s:34:\"Terminar a listagem neste título.\";'),('pt-br','messages:apihelp-query+deletedrevs-param-prefix','s:66:\"Procurar todos os títulos de página que começam por este valor.\";'),('pt-br','messages:apihelp-query+deletedrevs-param-unique','s:42:\"Listar só uma revisão para cada página.\";'),('pt-br','messages:apihelp-query+deletedrevs-param-tag','s:51:\"Listar só as revisões marcadas com esta etiqueta.\";'),('pt-br','messages:apihelp-query+deletedrevs-param-user','s:41:\"Listar só as revisões deste utilizador.\";'),('pt-br','messages:apihelp-query+deletedrevs-param-excludeuser','s:39:\"Não listar edições deste utilizador.\";'),('pt-br','messages:apihelp-query+deletedrevs-param-namespace','s:38:\"Listar só as páginas neste domínio.\";'),('pt-br','messages:apihelp-query+deletedrevs-param-limit','s:48:\"O número máximo de revisões a serem listadas.\";'),('pt-br','messages:apihelp-query+deletedrevs-param-prop','s:719:\"As propriedades a serem obtidas:\n;revid:Adiciona o identificador da revisão eliminada.\n;parentid:Adiciona o identificador da revisão anterior da página.\n;user:Adiciona o utilizador que fez a revisão.\n;userid:Adiciona o identificador do utilizador que fez a revisão.\n;comment:Adiciona o comentário da revisão.\n;parsedcomment:Adiciona o comentário da revisão após passagem pelo analisador sintático.\n;minor:Etiqueta a revisão como uma revisão menor.\n;len:Adiciona o comprimento (em bytes) da revisão.\n;sha1:Adiciona o SHA-1 da revisão (na base 16).\n;content:Adiciona o conteúdo da revisão.\n;token:<span class=\"apihelp-deprecated\">Obsoleto.</span> Fornece a chave da edição.\n;tags:Etiquetas da revisão.\";'),('pt-br','messages:apihelp-query+deletedrevs-example-mode1','s:132:\"Listar só as últimas revisões eliminadas das páginas <kbd>Main Page</kbd> e <kbd>Talk:Main Page</kbd>, com o conteúdo (modo 1).\";'),('pt-br','messages:apihelp-query+deletedrevs-example-mode2','s:87:\"Listar as últimas 50 contribuições eliminadas do utilizador <kbd>Bob</kbd> (modo 2).\";'),('pt-br','messages:apihelp-query+deletedrevs-example-mode3-main','s:82:\"Listar as primeiras 50 revisões eliminadas no espaço nominal principal (modo 3).\";'),('pt-br','messages:apihelp-query+deletedrevs-example-mode3-talk','s:83:\"Listar as primeiras 50 páginas eliminadas no espaço nominal {{ns:talk}} (modo 3).\";'),('pt-br','messages:apihelp-query+disabled-description','s:40:\"Este módulo de consulta foi desativado.\";'),('pt-br','messages:apihelp-query+duplicatefiles-description','s:108:\"Listar todos os ficheiros que são duplicados dos ficheiros indicados com base no seu resumo criptográfico.\";'),('pt-br','messages:apihelp-query+duplicatefiles-param-localonly','s:45:\"Procurar ficheiros só no repositório local.\";'),('pt-br','messages:apihelp-query+duplicatefiles-example-simple','s:71:\"Procurar os ficheiros duplicados de [[:File:Albert Einstein Head.jpg]].\";'),('pt-br','messages:apihelp-query+duplicatefiles-example-generated','s:42:\"Procurar duplicados de todos os ficheiros.\";'),('pt-br','messages:apihelp-query+embeddedin-description','s:75:\"Encontrar todas as páginas que incorporam (transcluem) o título indicado.\";'),('pt-br','messages:apihelp-query+extlinks-param-protocol','s:176:\"Protocolo do URL. Se vazio e <var>$1query</var> está definido, o protocolo é <kbd>http</kbd>. Deixe isto e  <var>$1query</var> vazios para listar todos os \'\'links\'\' externos.\";'),('pt-br','messages:apihelp-query+extlinks-param-query','s:116:\"Texto de pesquisa sem protocolo. Útil para verificar se uma determinada página contém um determinado URL externo.\";'),('pt-br','messages:apihelp-query+extlinks-param-expandurl','s:64:\"Expandir os URL relativos a protocolo com o protocolo canónico.\";'),('pt-br','messages:apihelp-query+extlinks-example-simple','s:64:\"Obter uma lista das ligações externas na <kbd>Main Page</kbd>.\";'),('pt-br','messages:apihelp-query+exturlusage-description','s:52:\"Enumerar as páginas que contêm um determinado URL.\";'),('pt-br','messages:apihelp-query+exturlusage-paramvalue-prop-ids','s:36:\"Adiciona o identificador da página.\";'),('pt-br','messages:apihelp-query+exturlusage-paramvalue-prop-title','s:67:\"Adiciona o título e o identificador do espaço nominal da página.\";'),('pt-br','messages:apihelp-query+exturlusage-paramvalue-prop-url','s:32:\"Adiciona o URL usado na página.\";'),('pt-br','messages:apihelp-query+exturlusage-param-protocol','s:176:\"Protocolo do URL. Se vazio e <var>$1query</var> está definido, o protocolo é <kbd>http</kbd>. Deixe isto e  <var>$1query</var> vazios para listar todos os \'\'links\'\' externos.\";'),('pt-br','messages:apihelp-query+exturlusage-param-query','s:117:\"Texto da pesquisa sem um protocolo. Ver [[Special:LinkSearch]]. Deixar vazio para listar todos os \'\'links\'\' externos.\";'),('pt-br','messages:apihelp-query+exturlusage-param-namespace','s:40:\"Os espaços nominais a serem enumerados.\";'),('pt-