-example-simple','s:64:\"Mostrar as páginas que usam [[:File:Albert Einstein Head.jpg]].\";'),('pt-br','messages:apihelp-query+imageusage-example-generator','s:93:\"Obter informações sobre as páginas que usam o ficheiro [[:File:Albert Einstein Head.jpg]].\";'),('pt-br','messages:apihelp-query+info-description','s:40:\"Obter a informação básica da página.\";'),('pt-br','messages:apihelp-query+info-param-prop','s:49:\"As propriedades adicionais que devem ser obtidas:\";'),('pt-br','messages:apihelp-query+info-paramvalue-prop-protection','s:46:\"Listar o nível de proteção de cada página.\";'),('pt-br','messages:apihelp-query+info-paramvalue-prop-talkid','s:85:\"O identificador da página de discussão de cada página que não seja de discussão.\";'),('pt-br','messages:apihelp-query+info-paramvalue-prop-watched','s:47:\"Listar o estado de vigilância de cada página.\";'),('pt-br','messages:apihelp-query+info-paramvalue-prop-watchers','s:42:\"O número de vigilantes, se for permitido.\";'),('pt-br','messages:apihelp-query+info-paramvalue-prop-visitingwatchers','s:101:\"O número de vigilantes de cada página que visitaram edições recentes dessa página, se permitido.\";'),('pt-br','messages:apihelp-query+info-paramvalue-prop-notificationtimestamp','s:73:\"A data e hora das notificações de alterações de cada página vigiada.\";'),('pt-br','messages:apihelp-query+info-paramvalue-prop-subjectid','s:69:\"O identificador da página progenitora de cada página de discussão.\";'),('pt-br','messages:apihelp-query+info-paramvalue-prop-url','s:81:\"Fornece um URL completo, um URL de edição e o URL canónico, para cada página.\";'),('pt-br','messages:apihelp-query+info-param-token','s:82:\"Em substituição, usar [[Special:ApiHelp/query+tokens|action=query&meta=tokens]].\";'),('pt-br','messages:apihelp-query+info-example-protection','s:78:\"Obter informação geral e de proteção sobre a página <kbd>Main Page</kbd>.\";'),('pt-br','messages:apihelp-query+iwbacklinks-param-title','s:94:\"O \'\'link\'\