ediaWiki</kbd>.\";'),('pt-br','messages:apihelp-query+pageswithprop-description','s:62:\"Listar todas as páginas que usam uma determinada propriedade.\";'),('pt-br','messages:apihelp-query+pageswithprop-param-propname','s:226:\"A propriedade de página a partir da qual as páginas serão enumeradas (<kbd>[[Special:ApiHelp/query+pagepropnames|action=query&list=pagepropnames]]</kbd> devolve os nomes das propriedades de página que estão a ser usadas).\";'),('pt-br','messages:apihelp-query+pageswithprop-paramvalue-prop-ids','s:36:\"Adiciona o identificador da página.\";'),('pt-br','messages:apihelp-query+pageswithprop-paramvalue-prop-title','s:67:\"Adiciona o título e o identificador do espaço nominal da página.\";'),('pt-br','messages:apihelp-query+pageswithprop-paramvalue-prop-value','s:43:\"Adiciona o valor da propriedade da página.\";'),('pt-br','messages:apihelp-query+pageswithprop-param-limit','s:49:\"O número máximo de páginas a serem devolvidas.\";'),('pt-br','messages:apihelp-query+pageswithprop-example-simple','s:106:\"Listar as primeiras 10 páginas que usam a propriedade <code>&#123;&#123;DISPLAYTITLE:&#125;&#125;</code>.\";'),('pt-br','messages:apihelp-query+pageswithprop-example-generator','s:100:\"Obter informação adicional sobre as primeiras 10 páginas que usam <code>_&#95;NOTOC_&#95;</code>.\";'),('pt-br','messages:apihelp-query+prefixsearch-description','s:634:\"Realizar uma procura de prefixo nos títulos de página.\n\nApesar da semelhança de nomes, este módulo não pretende ser equivalente a [[Special:PrefixIndex]]; para este, consulte <kbd>[[Special:ApiHelp/query+allpages|action=query&list=allpages]]</kbd> com o parâmetro <kbd>apprefix</kbd>. O propósito deste módulo é semelhante a <kbd>[[Special:ApiHelp/opensearch|action=opensearch]]</kbd>: receber dados introduzidos pelo utilizador e devolver os títulos com melhor correspondência. Dependendo do motor de busca do servidor, isto pode incluir correções de erros ortográficos, evitar redirecionamentos, e outras heurísticas.\";'),('pt-br','messages:apihelp-query+prefixsearch-param-search','s:25:\"O texto a ser pesquisado.\";'),('pt-br','messages:apihelp-query+prefixsearch-param-namespace','s:46:\"Os espaços nominais onde realizar a pesquisa.\";'),('pt-br','messages:apihelp-query+prefixsearch-param-offset','s:41:\"O número de resultados a serem omitidos.\";'),('pt-br','messages:apihelp-query+prefixsearch-example-simple','s:68:\"Procurar os títulos de página que começam por <kbd>meaning</kbd>.\";'),('pt-br','messages:apihelp-query+prefixsearch-param-profile','s:37:\"O perfil de pesquisa a ser utilizado.\";'),('pt-br','messages:apihelp-query+protectedtitles-description','s:55:\"Listar todos os títulos cuja criação está impedida.\";'),('pt-br','messages:apihelp-query+protectedtitles-param-namespace','s:48:\"Listar só os títulos nestes espaços nominais.\";'),('pt-br','messages:apihelp-query+protectedtitles-param-level','s:55:\"Listar só os títulos com estes níveis de proteção.\";'),('pt-br','messages:apihelp-query+protectedtitles-param-start','s:72:\"Começar a listagem pelo título que tem esta data e hora de proteção.\";'),('pt-br','messages:apihelp-query+protectedtitles-param-end','s:70:\"Terminar a listagem no título que tem esta data e hora de proteção.\";'),('pt-br','messages:apihelp-query+protectedtitles-paramvalue-prop-timestamp','s:57:\"Adiciona a data e hora a que a proteção foi adicionada.\";'),('pt-br','messages:apihelp-query+protectedtitles-paramvalue-prop-user','s:43:\"Adiciona o utilizador que fez a proteção.\";'),('pt-br','messages:apihelp-query+protectedtitles-paramvalue-prop-userid','s:60:\"Adiciona o identificador do utilizador que fez a proteção.\";'),('pt-br','messages:apihelp-query+protectedtitles-paramvalue-prop-comment','s:37:\"Adiciona o comentário da proteção.\";'),('pt-br','messages:apihelp-query+protectedtitles-paramvalue-prop-parsedcomment','s:65:\"Adiciona o comentário da proteção após a análise sintática.\";'),('pt-br','messages:apihelp-query+protectedtitles-paramvalue-prop-expiry','s:57:\"Adiciona a data e hora a que a proteção será removida.\";'),('pt-br','messages:apihelp-query+protectedtitles-example-generator','s:95:\"Encontrar as ligações para os títulos protegidos que pertencem ao espaço nominal principal.\";'),('pt-br','messages:apihelp-query+querypage-description','s:88:\"Obter uma lista fornecida por uma página especial baseada em consultas (\'\'QueryPage\'\').\";'),('pt-br','messages:apihelp-query+querypage-param-page','s:83:\"O nome da página especial. Note que este é sensível a maiúsculas e minúsculas.\";'),('pt-br','messages:apihelp-query+querypage-example-ancientpages','s:59:\"Devolver os resultados da página [[Special:Ancientpages]].\";'),('pt-br','messages:apihelp-query+random-description','s:399:\"Obter um conjunto de páginas aleatórias.\n\nAs páginas são listadas em sequência fixa, só o ponto de início da listagem é aleatório. Isto significa, por exemplo, que se a primeira página aleatória na lista é <samp>Main Page</samp>, a página <samp>List of fictional monkeys</samp> será <em>sempre</em> a segunda, a página <samp>List of people on stamps of Vanuatu</samp> a terceira, etc.\";'),('pt-br','messages:apihelp-query+random-param-namespace','s:61:\"Devolver só as páginas que estão nestes espaços nominais.\";'),('pt-br','messages:apihelp-query+random-param-redirect','s:53:\"Em vez dele, usar <kbd>$1filterredir=redirects</kbd>.\";'),('pt-br','messages:apihelp-query+random-example-simple','s:64:\"Devolver duas páginas aleatórias do espaço nominal principal.\";'),('pt-br','messages:apihelp-query+random-example-generator','s:94:\"Devolver informação de página sobre duas páginas aleatórias do espaço nominal principal.\";'),('pt-br','messages:apihelp-query+recentchanges-description','s:31:\"Enumerar as mudanças recentes.\";'),('pt-br','messages:apihelp-query+recentchanges-param-start','s:62:\"A data e hora a partir da qual será começada a enumeração.\";'),('pt-br','messages:apihelp-query+recentchanges-param-end','s:53:\"A data e hora na qual será terminada a enumeração.\";'),('pt-br','messages:apihelp-query+recentchanges-param-namespace','s:67:\"Filtrar as mudanças para produzir só as destes espaços nominais.\";'),('pt-br','messages:apihelp-query+recentchanges-param-prop','s:33:\"Incluir informações adicionais:\";'),('pt-br','messages:apihelp-query+recentchanges-paramvalue-prop-user','s:92:\"Adiciona o utilizador responsável pela edição e marca se o utilizador é um endereço IP.\";'),('pt-br','messages:apihelp-query+recentchanges-paramvalue-prop-userid','s:66:\"Adiciona o identificador do utilizador responsável pela edição.\";'),('pt-br','messages:apihelp-query+recentchanges-paramvalue-prop-comment','s:35:\"Adiciona o comentário da edição.\";'),('pt-br','messages:apihelp-query+recentchanges-paramvalue-prop-parsedcomment','s:62:\"Adiciona o comentário da edição, após análise sintática.\";'),('pt-br','messages:apihelp-query+recentchanges-paramvalue-prop-timestamp','s:35:\"Adiciona a data e hora da edição.\";'),('pt-br','messages:apihelp-query+recentchanges-paramvalue-prop-title','s:42:\"Adiciona o título de página da edição.\";'),('pt-br','messages:apihelp-query+recentchanges-paramvalue-prop-ids','s:93:\"Adiciona o identificadores da página, das mudanças recentes, e das revisões nova e antiga.\";'),('pt-br','messages:apihelp-query+recentchanges-paramvalue-prop-sizes','s:59:\"Adiciona os tamanhos antigo e novo da página em \'\'bytes\'\'.\";'),('pt-br','messages:apihelp-query+recentchanges-paramvalue-prop-redirect','s:51:\"Etiqueta a página se esta for um redirecionamento.\";'),('pt-br','messages:apihelp-query+recentchanges-paramvalue-prop-patrolled','s:98:\"Etiqueta as edições que podem ser patrulhadas, marcando-as como patrulhadas ou não patrulhadas.\";'),('pt-br','messages:apihelp-query+recentchanges-paramvalue-prop-loginfo','s:107:\"Adiciona informação de registo (identificador do registo, tipo de entrada, etc.) às entradas do registo.\";'),('pt-br','messages:apihelp-query+recentchanges-paramvalue-prop-sha1','s:86:\"Adiciona a soma de controlo do conteúdo para as entradas associadas com uma revisão.\";'),('pt-br','messages:apihelp-query+recentchanges-param-token','s:93:\"Em substituição, usar <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd>.\";'),('pt-br','messages:apihelp-query+recentchanges-param-show','s:172:\"Mostrar só as entradas que correspondem a estes critérios. Por exemplo, para ver só as edições menores feitas por utilizadores autenticados, defina $1show=minor|!anon.\";'),('pt-br','messages:apihelp-query+recentchanges-param-type','s:40:\"Os tipos de mudanças a serem mostradas.\";'),('pt-br','messages:apihelp-query+recentchanges-param-toponly','s:60:\"Listar só as alterações que são a revisão mais recente.\";'),('pt-br','messages:apihelp-query+recentchanges-param-generaterevisions','s:237:\"Ao ser usado como gerador, gerar identificadores de revisões em vez de títulos. As entradas das mudanças recentes que não tenham identificadores de revisão associados (por exemplo, a maioria das entradas do registo) não geram nada.\";'),('pt-br','messages:apihelp-query+recentchanges-example-generator','s:77:\"Obter informação de página acerca das mudanças recentes não patrulhadas.\";'),('pt-br','messages:apihelp-query+redirects-description','s:62:\"Devolve todos os redirecionamentos para as páginas indicadas.\";'),('pt-br','messages:apihelp-query+redirects-paramvalue-prop-pageid','s:52:\"O identificador de página de cada redirecionamento.\";'),('pt-br','messages:apihelp-query+redirects-param-show','s:183:\"Mostrar só as páginas que correspondem a estes critérios:\n;fragment:Mostrar só os redirecionamentos com um fragmento.\n;!fragment:Mostrar só os redirecionamentos sem um fragmento.\";'),('pt-br','messages:apihelp-query+redirects-example-simple','s:67:\"Obter uma lista dos redirecionamentos para a página [[Main Page]].\";'),('pt-br','messages:apihelp-query+redirects-example-generator','s:81:\"Obter informação sobre todos os redirecionamentos para a página [[Main Page]].\";'),('pt-br','messages:apihelp-query+revisions-description','s:401:\"Obter informação da revisão.\n\nPode ser usado de várias maneiras:\n# Obter dados sobre um conjunto de páginas (última revisão), definindo títulos ou identificadores de páginas.\n# Obter as revisões de uma página indicada, usando títulos ou identificadores de páginas, com start, end ou limit.\n# Obter dados sobre um conjunto de revisões definindo os respetivos identificadores de revisões.\";'),('pt-br','messages:apihelp-query+revisions-paraminfo-singlepageonly','s:51:\"Só pode ser usado com uma única página (modo #2)\";'),('pt-br','messages:apihelp-query+revisions-param-startid','s:76:\"O identificador de revisão a partir do qual será começada a enumeração.\";'),('pt-br','messages:apihelp-query+revisions-param-endid','s:69:\"Terminar a enumeração de revisões neste identificador de revisão.\";'),('pt-br','messages:apihelp-query+revisions-param-start','s:74:\"A data e hora da revisão a partir da qual será começada a enumeração.\";'),('pt-br','messages:apihelp-query+revisions-param-end','s:65:\"A data e hora da revisão na qual será terminada a enumeração.\";'),('pt-br','messages:apihelp-query+revisions-param-user','s:42:\"Incluir só as revisões deste utilizador.\";'),('pt-br','messages:apihelp-query+revisions-param-excludeuser','s:38:\"Excluir as revisões deste utilizador.\";'),('pt-br','messages:apihelp-query+revisions-param-tag','s:51:\"Listar só as revisões marcadas com esta etiqueta.\";'),('pt-br','messages:apihelp-query+revisions-param-token','s:36:\"Que chaves obter para cada revisão.\";'),('pt-br','messages:apihelp-query+revisions-example-content','s:99:\"Obter dados com o conteúdo da última revisão dos títulos <kbd>API</kbd> e <kbd>Main Page</kbd>.\";'),('pt-br','messages:apihelp-query+revisions+base-paramvalue-prop-ids','s:28:\"O identificador da revisão.\";'),('pt-br','messages:apihelp-query+revisions+base-paramvalue-prop-flags','s:33:\"As etiquetas da revisão (menor).\";'),('pt-br','messages:apihelp-query+revisions+base-paramvalue-prop-timestamp','s:26:\"A data e hora da revisão.\";'),('pt-br','messages:apihelp-query+revisions+base-paramvalue-prop-user','s:32:\"O utilizador que fez a revisão.\";'),('pt-br','messages:apihelp-query+revisions+base-paramvalue-prop-userid','s:53:\"O identificador de utilizador do criador da revisão.\";'),('pt-br','messages:apihelp-query+revisions+base-paramvalue-prop-size','s:33:\"O tamanho (em bytes) da revisão.\";'),('pt-br','messages:apihelp-query+revisions+base-paramvalue-prop-sha1','s:55:\"O resumo criptográfico SHA-1 (na base 16) da revisão.\";'),('pt-br','messages:apihelp-query+revisions+base-paramvalue-prop-contentmodel','s:51:\"O identificador do modelo de conteúdo da revisão.\";'),('pt-br','messages:apihelp-query+revisions+base-paramvalue-prop-comment','s:44:\"O comentário do utilizador para a revisão.\";'),('pt-br','messages:apihelp-query+revisions+base-paramvalue-prop-parsedcomment','s:73:\"O comentário do utilizador para a revisão, após a análise sintática.\";'),('pt-br','messages:apihelp-query+revisions+base-paramvalue-prop-parsetree','s:98:\"A árvore de análise XML do conteúdo da revisão (requer o modelo de conteúdo <code>$1</code>).\";'),('pt-br','messages:apihelp-query+revisions+base-param-expandtemplates','s:74:\"Expandir predefinições no conteúdo da revisão (requer $1prop=content).\";'),('pt-br','messages:apihelp-query+revisions+base-param-generatexml','s:141:\"Gerar a árvore de análise sintática em XML do conteúdo da revisão (requer $1prop=content; substituído por <kbd>$1prop=parsetree</kbd>).\";'),('pt-br','messages:apihelp-query+revisions+base-param-parse','s:159:\"Fazer a análise sintática do conteúdo da revisão (requer $1prop=content). Por motivos de desempenho, se esta opção for usada $1limit é forçado a ser 1.\";'),('pt-br','messages:apihelp-query+revisions+base-param-section','s:58:\"Obter apenas o conteúdo da secção que tem este número.\";'),('pt-br','messages:apihelp-query+revisions+base-param-diffto','s:183:\"O identificador da revisão contra a qual será tirada uma lista de diferenças de cada revisão. Usar <kbd>prev</kbd> (anterior), <kbd>next</kbd> (seguinte) e <kbd>cur</kbd> (atual).\";'),('pt-br','messages:apihelp-query+revisions+base-param-difftotext','s:291:\"O texto contra o qual será tirada uma lista de diferenças de cada revisão. Só produz as diferenças para um número limitado de revisões. Tem precedência sobre <var>$1diffto</var>. Se <var>$1section</var> estiver definido, só o conteúdo dessa secção será comparado contra o texto.\";'),('pt-br','messages:apihelp-query+revisions+base-param-difftotextpst','s:144:\"Fazer uma transformação de pré-gravação ao texto antes de calcular as diferenças. Só é válido quando usado com <var>$1difftotext</var>.\";'),('pt-br','messages:apihelp-query+revisions+base-param-contentformat','s:97:\"O formato de seriação usado para <var>$1difftotext</var> e esperado para o conteúdo produzido.\";'),('pt-br','messages:apihelp-query+search-param-search','s:212:\"Procurar os títulos de página ou o conteúdo que corresponda a este valor. Pode usar o texto da pesquisa para invocar funcionalidades de pesquisa especiais, dependendo dos meios de pesquisa do servidor da wiki.\";'),('pt-br','messages:apihelp-query+search-param-namespace','s:39:\"Pesquisar só nestes espaços nominais.\";'),('pt-br','messages:apihelp-query+search-param-what','s:30:\"O tipo de pesquisa a executar.\";'),('pt-br','messages:apihelp-query+search-param-info','s:38:\"Quais os metadados a serem devolvidos.\";'),('pt-br','messages:apihelp-query+search-param-qiprofile','s:87:\"O perfil independente das pesquisas a ser usado (afeta o algoritmo de classificação).\";'),('pt-br','messages:apihelp-query+search-paramvalue-prop-redirectsnippet','s:88:\"Adiciona um fragmento de código com o título redirecionado, após análise sintática.\";'),('pt-br','messages:apihelp-query+search-paramvalue-prop-redirecttitle','s:54:\"Adiciona o título do redirecionamento correspondente.\";'),('pt-br','messages:apihelp-query+search-paramvalue-prop-sectionsnippet','s:101:\"Adiciona um fragmento de código com o título da secção correspondente, após análise sintática.\";'),('pt-br','messages:apihelp-query+search-paramvalue-prop-sectiontitle','s:46:\"Adiciona o título da secção correspondente.\";'),('pt-br','messages:apihelp-query+search-paramvalue-prop-categorysnippet','s:91:\"Adiciona um fragmento de código com a categoria correspondente, após análise sintática.\";'),('pt-br','messages:apihelp-query+search-paramvalue-prop-isfilematch','s:105:\"Adiciona um valor booleano que indica se a pesquisa encontrou correspondência no conteúdo de ficheiros.\";'),('pt-br','messages:apihelp-query+search-paramvalue-prop-score','s:60:\"<span class=\"apihelp-deprecated\">Obsoleto e ignorado.</span>\";'),('pt-br','messages:apihelp-query+search-paramvalue-prop-hasrelated','s:60:\"<span class=\"apihelp-deprecated\">Obsoleto e ignorado.</span>\";'),('pt-br','messages:apihelp-query+search-param-interwiki','s:59:\"Incluir resultados interwikis na pesquisa, se disponíveis.\";'),('pt-br','messages:apihelp-query+search-param-backend','s:70:\"O servidor de pesquisas a ser usado, se diferente do servidor padrão.\";'),('pt-br','messages:apihelp-query+search-param-enablerewrites','s:218:\"Ativar a reescrita da pesquisa interna. Alguns motores de pesquisa podem reescrever a pesquisa, substituindo-a por outra que consideram que dará melhores resultados, como acontece na correção de erros de ortografia.\";'),('pt-br','messages:apihelp-query+search-example-generator','s:93:\"Obter informação sobre as páginas devolvidas por uma pesquisa do termo <kbd>meaning</kbd>.\";'),('pt-br','messages:apihelp-query+siteinfo-description','s:45:\"Devolver informação geral sobre o \'\'site\'\'.\";'),('pt-br','messages:apihelp-query+siteinfo-param-prop','s:28:\"A informação a ser obtida:\";'),('pt-br','messages:apihelp-query+siteinfo