 administradores como a todos os restantes utilizadores.\";'),('pt-br','messages:apihelp-revisiondelete-param-reason','s:37:\"O motivo da eliminação ou restauro.\";'),('pt-br','messages:apihelp-revisiondelete-param-tags','s:59:\"Etiquetas a aplicar à entrada no registo de eliminações.\";'),('pt-br','messages:apihelp-revisiondelete-example-revision','s:81:\"Ocultar o conteúdo da revisão <kbd>12345</kbd> na página <kbd>Main Page</kbd>.\";'),('pt-br','messages:apihelp-revisiondelete-example-log','s:100:\"Ocultar todos os dados na entrada <kbd>67890</kbd> do registo com o motivo <kbd>BLP violation</kbd>.\";'),('pt-br','messages:apihelp-rollback-description','s:155:\"Desfazer a última edição da página.\n\nSe o último utilizador a editar a página realizou várias edições em sequência, estas serão todas desfeitas.\";'),('pt-br','messages:apihelp-rollback-param-tags','s:36:\"As etiquetas a aplicar à reversão.\";'),('pt-br','messages:apihelp-rollback-param-user','s:57:\"O nome do utilizador cujas edições vão ser revertidas.\";'),('pt-br','messages:apihelp-rollback-param-summary','s:90:\"Resumo personalizado da edição. Se estiver vazio, será utilizado o resumo por omissão.\";'),('pt-br','messages:apihelp-rollback-param-markbot','s:70:\"Marcar as edições revertidas e a reversão como edições de robôs.\";'),('pt-br','messages:apihelp-rollback-param-watchlist','s:163:\"Adicionar ou remover incondicionalmente a página da lista de páginas vigiadas do utilizador atual, usar as preferências ou não alterar o estado de vigilância.\";'),('pt-br','messages:apihelp-rollback-example-simple','s:98:\"Reverter as últimas edições da página <kbd>Main Page</kbd> pelo utilizador <kbd>Example</kbd>.\";'),('pt-br','messages:apihelp-rollback-example-summary','s:212:\"Reverter as últimas edições da página <kbd>Main Page</kbd> pelo utilizador IP <kbd>192.0.2.5</kbd> com o resumo <kbd>Reverting vandalism</kbd>, e marcar essas edições e a reversão como edições de robôs.\";'),('pt-br','messages:apihelp-rsd-description','s:63:\"Exportar um esquema (\'\'schema\'\') RSD (Really Simple Discovery).\";'),('pt-br','messages:apihelp-rsd-example-simple','s:23:\"Exportar o esquema RSD.\";'),('pt-br','messages:apihelp-setnotificationtimestamp-description','s:277:\"Atualizar a data e hora de notificação de alterações às páginas vigiadas.\n\nIsto afeta o realce das páginas alteradas, na lista de páginas vigiadas e no histórico, e o envio de mensagens de correio quando a preferência \"{{int:tog-enotifwatchlistpages}}\" está ativada.\";'),('pt-br','messages:apihelp-setnotificationtimestamp-param-timestamp','s:58:\"A data e hora a definir como data e hora da notificação.\";'),('pt-br','messages:apihelp-setnotificationtimestamp-param-torevid','s:80:\"A revisão para a qual definir a data e hora de notificação (só uma página).\";'),('pt-br','messages:apihelp-setnotificationtimestamp-param-newerthanrevid','s:96:\"A revisão da qual definir que a data e hora de notificação é mais recente (só uma página).\";'),('pt-br','messages:apihelp-setnotificationtimestamp-example-all','s:66:\"Reiniciar o estado de notificação de todas as páginas vigiadas.\";'),('pt-br','messages:apihelp-setnotificationtimestamp-example-page','s:68:\"Reiniciar o estado de notificação da página <kbd>Main page</kbd>.\";'),('pt-br','messages:apihelp-setnotificationtimestamp-example-pagetimestamp','s:173:\"Definir a data e hora de notificação para a página <kbd>Main page</kbd> de forma a que todas as edições desde 1 de janeiro de 2012 passem a ser consideradas não vistas\";'),('pt-br','messages:apihelp-setnotificationtimestamp-example-allpages','s:91:\"Reiniciar o estado de notificação das páginas no espaço nominal <kbd>{{ns:user}}</kbd>.\";'),('pt-br','messages:apihelp-setpagelanguage-description','s:33:\"Alterar a língua de uma página.\";'),('pt-br','messages:apihelp-setpagelanguage-description-disabled','s:164:\"Não é permitido alterar a língua de uma página nesta wiki.\n\nAtivar <var>[[mw:Manual:$wgPageLanguageUseDB|$wgPageLanguageUseDB]]</var> para usar esta operação.\";'),('pt-br','messages:apihelp-setpagelanguage-param-title','s:108:\"O título da página cuja língua pretende alterar. Não pode ser usado em conjunto com <var>$1pageid</var>.\";'),('pt-br','messages:apihelp-setpagelanguage-param-pageid','s:113:\"O identificador da página cuja língua pretende alterar. Não pode ser usado em conjunto com <var>$1title</var>.\";'),('pt-br','messages:apihelp-setpagelanguage-param-lang','s:175:\"O código de língua, da língua para a qual a página será alterada. Usar <kbd>default</kbd> para redefinir a língua da página para a língua padrão de conteúdo da wiki.\";'),('pt-br','messages:apihelp-setpagelanguage-param-reason','s:22:\"Motivo da alteração.\";'),('pt-br','messages:apihelp-setpagelanguage-param-tags','s:92:\"As etiquetas de modificação a aplicar à entrada no registo que resultar desta operação.\";'),('pt-br','messages:apihelp-setpagelanguage-example-language','s:61:\"Alterar a língua da página <kbd>Main Page</kbd> para basco.\";'),('pt-br','messages:apihelp-setpagelanguage-example-default','s:97:\"Alterar a língua da página com o identificador 123 para a língua padrão de conteúdo da wiki.\";'),('pt-br','messages:apihelp-stashedit-description','s:174:\"Preparar uma edição na \'\'cache\'\' partilhada.\n\nIsto destina-se a ser usado via AJAX a partir do formulário de edição, para melhorar o desempenho da gravação da página.\";'),('pt-br','messages:apihelp-stashedit-param-title','s:43:\"Título da página que está a ser editada.\";'),('pt-br','messages:apihelp-stashedit-param-section','s:97:\"Número da secção. <kbd>0</kbd> para a secção do topo, <kbd>new</kbd> para uma secção nova.\";'),('pt-br','messages:apihelp-stashedit-param-stashedtexthash','s:150:\"O resumo criptográfico do conteúdo da página, resultante de uma colocação anterior na área de ficheiros escondidos, a ser usado em vez de outro.\";'),('pt-br','messages:apihelp-stashedit-param-baserevid','s:48:\"O identificador de revisão da revisão de base.\";'),('pt-br','messages:apihelp-tag-description','s:110:\"Adicionar ou remover as etiquetas de modificação aplicadas a revisões individuais ou a entradas do registo.\";'),('pt-br','messages:apihelp-tag-param-rcid','s:91:\"Um ou mais identificadores de mudanças recentes às quais adicionar ou remover a etiqueta.\";'),('pt-br','messages:apihelp-tag-param-revid','s:82:\"Um ou mais identificadores de revisões às quais adicionar ou remover a etiqueta.\";'),('pt-br','messages:apihelp-tag-param-logid','s:92:\"Um ou mais identificadores de entradas do registo às quais adicionar ou remover a etiqueta.\";'),('pt-br','messages:apihelp-tag-param-add','s:95:\"As etiquetas a serem adicionadas. Só podem ser adicionadas as etiquetas definidas manualmente.\";'),('pt-br','messages:apihelp-tag-param-remove','s:120:\"As etiquetas a serem removidas. Só podem ser removidas as etiquetas definidas manualmente ou completamente indefinidas.\";'),('pt-br','messages:apihelp-tag-param-tags','s:109:\"As etiquetas de modificação a aplicar à entrada no registo que será criada em resultado desta operação.\";'),('pt-br','messages:apihelp-tag-example-rev','s:105:\"Adicionar a etiqueta <kbd>vandalism</kbd> à revisão com o identificador 123, sem especificar um motivo.\";'),('pt-br','messages:apihelp-tag-example-log','s:122:\"Remover a etiqueta <kbd>spam</kbd> da entrada do registo com o identificador 123, com o motivo <kbd>Wrongly applied</kbd>.\";'),('pt-br','messages:apihelp-tokens-description','s:164:\"Obter chaves para operações de modificação de dados.\n\nEste módulo é obsoleto e foi substituído por [[Special:ApiHelp/query+tokens|action=query&meta=tokens]].\";'),('pt-br','messages:apihelp-tokens-param-type','s:23:\"Tipos de chave a pedir.\";'),('pt-br','messages:apihelp-tokens-example-edit','s:38:\"Obter uma chave de edição (padrão).\";'),('pt-br','messages:apihelp-tokens-example-emailmove','s:69:\"Obter uma chave de correio eletrónico e uma chave de movimentação.\";'),('pt-br','messages:apihelp-unblock-param-userid','s:123:\"O identificador do utilizador a ser desbloqueado. Não pode ser usado em conjunto com <var>$1id</var> ou <var>$1user</var>.\";'),('pt-br','messages:apihelp-unblock-param-tags','s:75:\"As etiquetas de modificação a aplicar à entrada no registo de bloqueios.\";'),('pt-br','messages:apihelp-unblock-example-user','s:74:\"Desbloquear o utilizador <kbd>Bob</kbd> com o motivo <kbd>Sorry Bob</kbd>.\";'),('pt-br','messages:apihelp-undelete-description','s:323:\"Restaurar revisões de uma página eliminada.\n\nPode obter-se uma lista de revisões eliminadas (incluindo as datas e horas de eliminação) com [[Special:ApiHelp/query+deletedrevisions|prop=deletedrevisions]] e uma lista de identificadores de ficheiros eliminados com [[Special:ApiHelp/query+filearchive|list=filearchive]].\";'),('pt-br','messages:apihelp-undelete-param-title','s:31:\"Título da página a restaurar.\";'),('pt-br','messages:apihelp-undelete-param-tags','s:76:\"Etiquetas de modificação a aplicar à entrada no registo de eliminações.\";'),('pt-br','messages:apihelp-undelete-param-timestamps','s:179:\"As datas e horas das revisões a serem restauradas. Se ambos os parâmetros <var>$1timestamps</var> e <var>$1fileids</var> estiverem vazios, serão restauradas todas as revisões.\";'),('pt-br','messages:apihelp-undelete-param-fileids','s:181:\"Os identificadores das revisões a serem restauradas. Se ambos os parâmetros <var>$1timestamps</var> e <var>$1fileids</var> estiverem vazios, serão restauradas todas as revisões.\";'),('pt-br','messages:apihelp-undelete-param-watchlist','s:163:\"Adicionar ou remover incondicionalmente a página da lista de páginas vigiadas do utilizador atual, usar as preferências ou não alterar o estado de vigilância.\";'),('pt-br','messages:apihelp-undelete-example-revisions','s:57:\"Restaurar duas revisões da página <kbd>Main Page</kbd>.\";'),('pt-br','messages:apihelp-unlinkaccount-description','s:66:\"Remover do utilizador atual uma conta ligada de uma wiki terceira.\";'),('pt-br','messages:apihelp-unlinkaccount-example-simple','s:111:\"Tentar remover a ligação do utilizador atual ao fornecedor associado com <kbd>FooAuthenticationRequest</kbd>.\";'),('pt-br','messages:apihelp-upload-description','s:695:\"Atualizar um ficheiro, ou obter o estado de carregamentos pendentes.\n\nEstão disponíveis vários métodos:\n* Carregar diretamente o conteúdo do ficheiro, usando o parâmetro <var>$1file</var>.\n* Carregar o ficheiro por segmentos, usando os parâmetros <var>$1filesize</var>, <var>$1chunk</var> e <var>$1offset</var>.\n* Instruir o servidor do MediaWiki para obter o ficheiro a partir de um URL, usando o parâmetro <var>$1url</var>.\n* Terminar um carregamento anterior que falhou devido a avisos, usando o parâmetro <var>$1filekey</var>.\nNote que o POST do HTTP tem de ser feito como um carregamento de ficheiro (isto é, usando <code>multipart/form-data</code>) ao enviar o <var>$1file</var>.\";'),('pt-br','messages:apihelp-upload-param-filename','s:30:\"O nome de destino do ficheiro.\";'),('pt-br','messages:apihelp-upload-param-comment','s:142:\"O comentário do carregamento. Também é usado como texto da página inicial para ficheiros novos se <var>$1text</var> não for especificado.\";'),('pt-br','messages:apihelp-upload-param-tags','s:112:\"Etiquetas de modificação a aplicar à entrada do carregamento no registo e à revisão da página de ficheiro.\";'),('pt-br','messages:apihelp-upload-param-text','s:46:\"Texto inicial da página para ficheiros novos.\";'),('pt-br','messages:apihelp-upload-param-watchlist','s:163:\"Adicionar ou remover incondicionalmente a página da lista de páginas vigiadas do utilizador atual, usar as preferências ou não alterar o estado de vigilância.\";'),('pt-br','messages:apihelp-upload-param-file','s:24:\"O conteúdo do ficheiro.\";'),('pt-br','messages:apihelp-upload-param-url','s:31:\"O URL de onde obter o ficheiro.\";'),('pt-br','messages:apihelp-upload-param-filekey','s:104:\"Chave que identifica um carregamento prévio que está temporariamente na área de ficheiros escondidos.\";'),('pt-br','messages:apihelp-upload-param-sessionkey','s:76:\"O mesmo que $1filekey, mantido para compatibilidade com versões anteriores.\";'),('pt-br','messages:apihelp-upload-param-stash','s:135:\"Se definido, o servidor irá colocar temporariamente o ficheiro na área de ficheiros escondidos em vez de o adicionar ao repositório.\";'),('pt-br','messages:apihelp-upload-param-filesize','s:35:\"O tamanho do carregamento completo.\";'),('pt-br','messages:apihelp-upload-param-offset','s:35:\"Posição do segmento em \'\'bytes\'\'.\";'),('pt-br','messages:apihelp-upload-param-chunk','s:24:\"O conteúdo do segmento.\";'),('pt-br','messages:apihelp-upload-param-async','s:91:\"Tornar assíncronas as operações sobre ficheiros possivelmente grandes, quando possível.\";'),('pt-br','messages:apihelp-upload-param-checkstatus','s:69:\"Obter só o estado de carregamento para a chave de ficheiro indicada.\";'),('pt-br','messages:apihelp-upload-example-url','s:19:\"Carregar de um URL.\";'),('pt-br','messages:apihelp-upload-example-filekey','s:54:\"Prosseguir um carregamento que falhou devido a avisos.\";'),('pt-br','messages:apihelp-userrights-description','s:47:\"Alterar os grupos a que um utilizador pertence.\";'),('pt-br','messages:apihelp-userrights-param-tags','s:91:\"Etiquetas de modificação a aplicar à entrada no registo de privilégios de utilizadores.\";'),('pt-br','messages:apihelp-userrights-example-user','s:130:\"Adicionar o utilizador <kbd>FooBot</kbd> ao grupo <kbd>bot</kbd> e removê-lo dos grupos <kbd>sysop</kbd> e <kbd>bureaucrat</kbd>.\";'),('pt-br','messages:apihelp-userrights-example-userid','s:147:\"Adicionar o utilizador com o identificador <kbd>123</kbd> ao grupo <kbd>bot</kbd> e removê-lo dos grupos <kbd>sysop</kbd> e <kbd>bureaucrat</kbd>.\";'),('pt-br','messages:apihelp-validatepassword-description','s:345:\"Validar uma palavra-passe face às regras para palavras-passe da wiki.\n\nA validade é reportada <samp>Good</samp> (Boa) se a palavra-passe é aceitável, <samp>Change</samp> (Alterar) se a palavra-passe pode ser usada para iniciar uma sessão mas terá de ser alterada, ou <samp>Invalid</samp> (Inválida) se a palavra-passe não é utilizável.\";'),('pt-br','messages:apihelp-validatepassword-param-password','s:31:\"A palavra-passe a ser validada.\";'),('pt-br','messages:apihelp-validatepassword-param-user','s:108:\"O nome de utilizador, para ser usado ao testar a criação de conta. O nome de utilizador não pode existir.\";'),('pt-br','messages:apihelp-validatepassword-param-email','s:82:\"O endereço de correio eletrónico, para ser usado ao testar a criação de conta.\";'),('pt-br','messages:apihelp-validatepassword-param-realname','s:65:\"O nome verdadeiro, para ser usado ao testar a criação de conta.\";'),('pt-br','messages:apihelp-validatepassword-example-1','s:66:\"Validar a palavra-passe <kbd>foobar</kbd> para o utilizador atual.\";'),('pt-br','messages:apihelp-validatepassword-example-2','s:92:\"Validar a palavra-passe <kbd>qwerty</kbd> para a criação do utilizador <kbd>Example</kbd>.\";'),('pt-br','messages:apihelp-watch-description','s:80:\"Adicionar ou remover páginas da lista de páginas vigiadas do utilizador atual.\";'),('pt-br','messages:apihelp-watch-param-title','s:84:\"A página a vigiar ou deixar de ser vigiada. Em vez disto, usar <var>$1titles</var>.\";'),('pt-br','messages:apihelp-watch-param-unwatch','s:64:\"Se definido, a página deixará de ser vigiada, em vez de o ser.\";'),('pt-br','messages:apihelp-watch-example-watch','s:38:\"Vigiar a página <kbd>Main Page</kbd>.\";'),('pt-br','messages:apihelp-watch-example-unwatch','s:48:\"Deixar de vigiar a página <kbd>Main Page</kbd>.\";'),('pt-br','messages:apihelp-watch-example-generator','s:58:\"Vigiar as primeiras páginas do espaço nominal principal.\";'),('pt-br','messages:apihelp-format-example-generic','s:47:\"Devolver o resultado da consulta no formato $1.\";'),('pt-br','messages:apihelp-format-param-wrappedhtml','s:106:\"Devolver o HTML com realce sintático e os módulos ResourceLoader associados, na forma de um objeto JSON.\";'),('pt-br','messages:apihelp-json-description','s:44:\"Produzir os dados de saída no formato JSON.\";'),('pt-br','messages:apihelp-json-param-callback','s:170:\"Se especificado, envolve o resultado de saída na forma de uma chamada para uma função. Por segurança, todos os dados específicos do utilizador estarão restringidos.\";'),('pt-br','messages:apihelp-json-param-utf8','s:242:\"Se especificado, codifica a maioria dos caracteres não ASCII (mas não todos) em UTF-8, em vez de substitui-los por sequências de escape hexadecimais. É o comportamento padrão quando <var>formatversion</var> não tem o valor <kbd>1</kbd>.\";'),('pt-br','messages:apihelp-json-param-ascii','s:181:\"Se especificado, codifica todos caracteres não ASCII usando sequências de escape hexadecimais. É o comportamento padrão quando <var>formatversion</var> tem o valor <kbd>1</kbd>.\";'),('pt-br','messages:apihelp-json-param-formatversion','s:333:\"Formatação do resultado de saída:\n;1:Formato compatível com versões anteriores (booleanos ao estilo XML, <samp>*</samp> chaves para nodos de conteúdo, etc.).\n;2:Formato moderno experimental. As especificações podem mudar!\n;latest:Usar o formato mais recente (atualmente <kbd>2</kbd>), mas pode ser alterado sem aviso prévio.\";'),('pt-br','messages:apihelp-jsonfm-description','s:72:\"Produzir os dados de saída em formato JSON (realce sintático em HTML).\";'),('pt-br','messages:apihelp-php-description','s:51:\"Produzir os dados de saída em formato PHP seriado.\";'),('pt-br','messages:apihelp-php-param-formatversion','s:333:\"Formatação do resultado de saída:\n;1:Formato compatível com versões anteriores (booleanos ao estilo XML, <samp>*</samp> chaves para nodos de conteúdo, etc.).\n;2:Formato moderno experimental. As especificações podem mudar!\n;latest:Usar o formato mais recente (atualmente <kbd>2</kbd>), mas pode ser alterado sem aviso prévio.\";'),('pt-br','messages:apihelp-phpfm-description','s:79:\"Produzir os dados de saída em formato PHP seriado (realce sintático em HTML).\";'),('pt-br','messages:apihelp-rawfm-description','s:117:\"Produzir os dados de saída, incluindo elementos para despiste de erros, em formato JSON (realce sintático em HTML).\";'),('pt-br','messages:apihelp-xml-description','s:43:\"Produzir os dados de saída em formato XML.\";'),('pt-br','messages:apihelp-xml-param-xslt','s:170:\"Se especificado, adiciona a página nomeada como uma folha de estilo XSL. O valor tem de ser um título no espaço nominal {{ns:MediaWiki}} e acabar em <code>.xsl</code>.\";'),('pt-br','messages:apihelp-xml-param-includexmlnamespace','s:49:\"Se especificado, adiciona um espaço nominal XML.\";'),('pt-br','messages:apihelp-xmlfm-description','s:71:\"Produzir os dados de saída em formato XML (realce sintático em HTML).\";'),('pt-br','messages:api-format-title','s:30:\"Resultado da API do MediaWiki.\";'),('pt-br','messages:api-format-prettyprint-header','s:412:\"Esta é a representação em HTML do formato $1. O HTML é bom para o despiste de erros, mas inadequado para uso na aplicação.\n\nEspecifique o parâmetro <var>format</var> para alterar o formato de saída. Para ver a representação que não é em HTML do formato $1, defina <kbd>format=$2</kbd>.\n\nConsulte a [[mw:API|documentação completa]], ou a [[Special:ApiHelp/main|ajuda da API]] para mais informação.\";'),('pt-br','messages:api-format-prettyprint-header-only-html','s:227:\"Esta é uma representação em HTML para ser usada no despiste de erros, mas inadequada para uso na aplicação.\n\nConsulte a [[mw:API|documentação completa]], ou a [[Special:ApiHelp/main|ajuda da API]] para mais informação.\";'),('pt-br','messages:api-format-prettyprint-status','s:58:\"Esta resposta seria devolvida com o estado de HTTP: $1 $2.\";'),('pt-br','messages:api-pageset-param-titles','s:43:\"Uma lista dos títulos a serem trabalhados.\";'),('pt-br','messages:api-pageset-param-pageids','s:61:\"Uma lista dos identificadores de página a serem trabalhados.\";'),('pt-br','messages:api-pageset-param-revids','s:63:\"Uma lista dos identificadores de revisões a serem trabalhados.\";'),('pt-br','messages:api-pageset-param-generator','s:208:\"Obter a lista de páginas nas quais trabalhar, executando o módulo de consulta especificado.\n\n<strong>Nota:</strong> Os nomes dos parâmetros de geradores têm de ser prefixados com um \"g\", veja os exemplos.\";'),('pt-br','messages:api-pageset-param-redirects-generator','s:190:\"Resolver automaticamente os redirecionamentos listados nos parâmetros  <var>$1titles</var>, <var>$1pageids</var> e <var>$1revids</var>, e nas páginas devolvidas por <var>$1generator</var>.\";'),('pt-br','messages:api-pageset-param-redirects-nogenerator','s:135:\"Resolver automaticamente os redirecionamentos listados nos parâmetros <var>$1titles</var>, <var>$1pageids</var> e <var>$1revids</var>.\";'),('pt-br','messages:api-pageset-param-converttitles','s:216:\"Converter os títulos noutras variantes de língua, se necessário. Só funciona se a língua de conteúdo da wiki suporta a conversão entre variantes. As línguas que suportam conversão entre variantes incluem $1.\";'),('pt-br','messages:api-help-title','s:25:\"Ajuda da API do MediaWiki\";'),('pt-br','messages:api-help-lead','s:144:\"Esta é uma página de documentação da API do MediaWiki gerada automaticamente.\n\nDocumentação e exemplos: https://www.mediawiki.org/wiki/API\";'),('pt-br','messages:api-help-main-header','s:17:\"Módulo principal\";'),('pt-br','messages:api-help-flag-internal','s:111:\"<strong>Este módulo é interno ou instável.</strong> O seu funcionamento pode ser alterado sem aviso prévio.\";'),('pt-br','messages:api-help-flag-readrights','s:40:\"Este módulo requer direitos de leitura.\";'),('pt-br','messages:api-help-flag-writerights','s:40:\"Este módulo requer direitos de escrita.\";'),('pt-br','messages:api-help-flag-mustbeposted','s:37:\"Este módulo só aceita pedidos POST.\";'),('pt-br','messages:api-help-flag-generator','s:41:\"Este módulo pode ser usado como gerador.\";'),('pt-br','messages:api-help-datatypes-header','s:13:\"Tipo de dados\";'),('pt-br','messages:api-help-datatypes','s:2701:\"O formato de entrada para o MediaWiki deve ser UTF-8, normalizado de acordo com a norma NFC. O MediaWiki pode converter outros tipos de entrada, mas esta conversão pode originar a falha de algumas operações (tais como as [[Special:ApiHelp/edit|edições]] com verificações MD5).\n\nAlguns tipos de parâmetros nos pedidos à API necessitam de mais explicações:\n;boolean\n:Os parâmetros booleanos funcionam como as caixas de seleção HTML: se o parâmetro for especificado, independentemente do seu valor, é considerado verdadeiro. Para um valor falso, omitir o parâmetro completo.\n;timestamp\n:As datas e horas podem ser especificadas em vários formatos. É recomendado o formato ISO 8601. Todas as horas estão em UTC, qualquer inclusão do fuso horário é ignorada.\n:* Data e hora ISO 8601, <kbd><var>2001</var>-<var>01</var>-<var>15</var>T<var>14</var>:<var>56</var>:<var>00</var>Z</kbd> (pontuação e <kbd>Z</kbd> são opcionais)\n:* Data e hora ISO 8601 com segundos fracionários (estes são ignorados), <kbd><var>2001</var>-<var>01</var>-<var>15</var>T<var>14</var>:<var>56</var>:<var>00</var>.<var>00001</var>Z</kbd> (traços, dois pontos e <kbd>Z</kbd> são opcionais)\n:* Formato do MediaWiki, <kbd><var>2001</var><var>01</var><var>15</var><var>14</var><var>56</var><var>00</var></kbd>\n:* Formato numérico genérico, <kbd><var>2001</var>-<var>01</var>-<var>15</var> <var>14</var>:<var>56</var>:<var>00</var></kbd> (fuso horário opcional <kbd>GMT</kbd>, <kbd>+<var>##</var></kbd>, ou <kbd>-<var>##</var></kbd> são ignorados)\n:* Formato EXIF, <kbd><var>2001</var>:<var>01</var>:<var>15</var> <var>14</var>:<var>56</var>:<var>00</var></kbd>\n:*Formato RFC 2822 (o fuso horário pode ser omitido), <kbd><var>Mon</var>, <var>15</var> <var>Jan</var> <var>2001</var> <var>14</var>:<var>56</var>:<var>00</var></kbd>\n:* Formato RFC 850 (o fuso horário pode ser omitido), <kbd><var>Monday</var>, <var>15</var>-<var>Jan</var>-<var>2001</var> <var>14</var>:<var>56</var>:<var>00</var></kbd>\n:* Formato C ctime, <kbd><var>Mon</var> <var>Jan</var> <var>15</var> <var>14</var>:<var>56</var>:<var>00</var> <var>2001</var></kbd>\n:* Segundos desde 1970-01-01T00:00:00Z como um inteiro de 1 a 13 algarismos (excluindo <kbd>0</kbd>)\n:* O texto <kbd>now</kbd>\n;separador alternativo de valores múltiplos\n:Os parâmetros que aceitam vários valores são normalmente fornecidos com os valores separados por uma barra vertical (\'\'pipe\'\'), por exemplo <kbd>parâmetro=valor1|valor2</kbd> ou <kbd>parâmetro=valor1%7Cvalor2</kbd>. Se um valor contém a barra vertical, use como separador o U+001F (Separador de Unidades) \'\'e\'\' prefixe o valor com U+001F, isto é, <kbd>parâmetro=%1Fvalor1%1Fvalor2</kbd>.\";'),('pt-br','messages:api-help-param-type-limit','s:31:\"Tipo: inteiro ou <kbd>max</kbd>\";'),('pt-br','messages:api-help-param-type-integer','s:58:\"Tipo: {{PLURAL:$1|1=inteiro|2=lista de números inteiros}}\";'),('pt-br','messages:api-help-param-type-boolean','s:65:\"Tipo: booleano ([[Special:ApiHelp/main#main/datatypes|detalhes]])\";'),('pt-br','messages:api-help-param-type-timestamp','s:120:\"Tipo: {{PLURAL:$1|1=data e hora|2=lista de datas e horas}} ([[Special:ApiHelp/main#main/datatypes|formatos permitidos]])\";'),('pt-br','messages:api-help-param-type-user','s:73:\"Tipo: {{PLURAL:$1|1=nome de utilizador|2=lista de nomes de utilizadores}}\";'),('pt-br','messages:api-help-param-list','s:143:\"{{PLURAL:$1|1=Um dos seguintes valores|2=Valores (separados com <kbd>{{!}}</kbd> ou [[Special:ApiHelp/main#main/datatypes|alternativas]])}}: $2\";'),('pt-br','messages:api-help-param-list-can-be-empty','s:62:\"{{PLURAL:$1|0=Tem de estar vazio|Pode estar vazio, ou ser $2}}\";'),('pt-br','messages:api-help-param-limit','s:36:\"Não são permitidos mais do que: $1\";'),('pt-br','messages:api-help-param-limit2','s:53:\"Não são permitidos mais do que $1 ($2 para robôs).\";'),('pt-br','messages:api-help-param-integer-min','s:93:\"{{PLURAL:$1|1=O valor não pode ser inferior a|2=Os valores não podem ser inferiores a}} $2.\";'),('pt-br','messages:api-help-param-integer-max','s:93:\"{{PLURAL:$1|1=O valor não pode ser superior a|2=Os valores não podem ser superiores a}} $3.\";'),('pt-br','messages:api-help-param-integer-minmax','s:105:\"{{PLURAL:$1|1=O valor tem de estar compreendido|2=Os valores têm de estar compreendidos}} entre $2 e $3.\";'),('pt-br','messages:api-help-param-upload','s:89:\"Tem ser enviado (\'\'posted\'\') como um carregamento de ficheiro usando multipart/form-data.\";'),('pt-br','messages:api-help-param-multi-separate','s:92:\"Separar os valores com <kbd>|</kbd> ou [[Special:ApiHelp/main#main/datatypes|alternativas]].\";'),('pt-br','messages:api-help-param-multi-max','s:80:\"O número máximo de valores é {{PLURAL:$1|$1}} ({{PLURAL:$2|$2}} para robôs).\";'),('pt-br','messages:api-help-param-multi-all','s:53:\"Para especificar todos os valores, use <kbd>$1</kbd>.\";'),('pt-br','messages:api-help-param-default','s:22:\"Valor por omissão: $1\";'),('pt-br','messages:api-help-param-default-empty','s:51:\"Padrão: <span class=\"apihelp-empty\">(vazio)</span>\";'),('pt-br','messages:api-help-param-token','s:82:\"Uma chave \"$1\" obtida de [[Special:ApiHelp/query+tokens|action=query&meta=tokens]]\";'),('pt-br','messages:api-help-param-token-webui','s:86:\"Para efeitos de compatibilidade, a chave usada na interface \'\'web\'\' também é aceite.\";'),('pt-br','messages:api-help-param-disabled-in-miser-mode','s:79:\"Desativado devido ao [[mw:Manual:$wgMiserMode|modo avarento]] (\'\'miser mode\'\').\";'),('pt-br','messages:api-help-param-limited-in-miser-mode','s:254:\"<strong>Nota:</strong> devido ao [[mw:Manual:$wgMiserMode|modo avarento]] (\'\'miser mode\'\'), usar isto pode resultar na devolução de menos de <var>$1limit</var> resultados antes de continuar; em casos extremos pode não ser devolvido qualquer resultado.\";'),('pt-br','messages:api-help-param-direction','s:202:\"A direção da enumeração:\n;newer:Listar o mais antigo primeiro. Nota: $1start tem de estar antes de $1end.\n;older:Listar o mais recente primeiro (padrão). Nota: $1start tem de estar depois de $1end.\";'),('pt-br','messages:api-help-param-continue','s:68:\"Quando houver mais resultados disponíveis, usar isto para continuar\";'),('pt-br','messages:api-help-param-no-description','s:52:\"<span class=\"apihelp-empty\">(sem descrição)</span>\";'),('pt-br','messages:api-help-examples','s:31:\"{{PLURAL:$1|Exemplo|Exemplos}}:\";'),('pt-br','messages:api-help-permissions','s:37:\"{{PLURAL:$1|Permissão|Permissões}}:\";'),('pt-br','messages:api-help-permissions-granted-to','s:42:\"{{PLURAL:$1|Concedida a|Concedidas a}}: $2\";'),('pt-br','messages:api-help-right-apihighlimits','s:178:\"Usar limites mais altos em consultas da API (consultas lentas: $1; consultas rápidas: $2). Os limites para consultas lentas também se aplicam a parâmetros com vários valores.\";'),('pt-br','messages:api-help-open-in-apisandbox','s:43:\"<small>[abrir na página de testes]</small>\";'),('pt-br','messages:api-help-authmanager-general-usage','s:1369:\"O procedimento geral para usar este módulo é:\n# Obtenha os campos disponíveis usando <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> com <kbd>amirequestsfor=$4</kbd> e uma chave <kbd>$5</kbd> obtida de <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd>.\n# Apresente os campos ao utilizador e obtenha os dados fornecidos por este.\n# Publique-os para este módulo, fornecendo <var>$1returnurl</var> e quaisquer campos relevantes.\n# Verifique o valor de <samp>status</samp> na resposta.\n#* Se recebeu <samp>PASS</samp> ou <samp>FAIL</samp>, terminou. A operação terá tido sucesso ou falhado.\n#* Se recebeu <samp>UI</samp>, apresente os novos campos ao utilizador e obtenha os dados fornecidos por este. Depois publique-os para este módulo com <var>$1continue</var> e os campos relevantes preenchidos, e repita o passo 4.\n#* Se recebeu <samp>REDIRECT</samp>, encaminhe o utilizador para <samp>redirecttarget</samp> e aguarde o retorno para o URL <var>$1returnurl</var>. Depois publique para este módulo com <var>$1continue</var> quaisquer campos que tenham sido passados ao URL de retorno, e repita o passo 4.\n#* Se recebeu <samp>RESTART</samp>, isto significa que a autenticação funcionou mas não temos uma conta de utilizador associada. Pode dar-lhe o tratamento de <samp>UI</samp> ou <samp>FAIL</samp>.\";'),('pt-br','messages:api-help-authmanagerhelper-requests','s:241:\"Usar só estes pedidos de autenticação, com o <samp>id</samp> devolvido por <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> com <kbd>amirequestsfor=$1</kbd> ou por uma resposta anterior deste módulo.\";'),('pt-br','messages:api-help-authmanagerhelper-request','s:192:\"Usar este pedido de autenticação, com o <samp>id</samp> devolvido por <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> com <kbd>amirequestsfor=$1</kbd>.\";'),('pt-br','messages:api-help-authmanagerhelper-messageformat','s:39:\"Formato a usar nas mensagens de saída.\";'),('pt-br','messages:api-help-authmanagerhelper-mergerequestfields','s:81:\"Combinar a informação de todos os pedidos de autenticação numa única matriz.\";'),('pt-br','messages:api-help-authmanagerhelper-preservestate','s:85:\"Preservar o estado de uma tentativa de autenticação anterior falhada, se possível.\";'),('pt-br','messages:api-help-authmanagerhelper-returnurl','s:614:\"O URL de retorno para processos de autenticação por terceiros tem de ser absoluto. É obrigatório fornecer este URL ou <var>$1continue</var>.\n\nTipicamente, após receber uma resposta <samp>REDIRECT</samp>, abrirá um \'\'browser\'\' ou uma \'\'web view\'\' para o URL <samp>redirecttarget</samp> especificado, para dar lugar ao processo de autenticação por terceiros. Quando esse processo terminar, a terceira entidade encaminhará o \'\'browser\'\' ou a \'\'web view\'\' para este URL. Deve extrair do URL quaisquer parâmetros de consulta ou de POST, e passá-los como um pedido <var>$1continue</var> a este módulo da API.\";'),('pt-br','messages:api-help-authmanagerhelper-continue','s:195:\"Este pedido é uma continuação após uma resposta anterior com o valor <samp>UI</samp> ou <samp>REDIRECT</samp>. É obrigatório fornecer este parâmetro ou o parâmetro <var>$1returnurl</var>.\";'),('pt-br','messages:api-help-authmanagerhelper-additional-params','s:350:\"Este módulo aceita parâmetros adicionais, dependendo dos pedidos de autenticação disponíveis. Use <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> com <kbd>amirequestsfor=$1</kbd> (ou uma resposta anterior deste módulo, se aplicável) para determinar os pedidos disponíveis e os campos que estes utilizam.\";'),('pt-br','messages:api-credits','s:443:\"Programadores da API:\n* Yuri Astrakhan (criador, programador principal, set 2006–set 2007)\n* Roan Kattouw (programador principal, set 2007–2009)\n* Victor Vasiliev\n* Bryan Tong Minh\n* Sam Reed\n* Brad Jorsch (programador principal, 2013–presente)\n\nPode enviar os seus comentários, sugestões e perguntas para o endereço mediawiki-api@lists.wikimedia.org, ou reportar quaisquer defeitos que encontre em https://phabricator.wikimedia.org/.\";'),('pt-br','messages:captcha-help','s:21:\"Solução do CAPTCHA.\";'),('pt-br','messages:captcha-id-label','s:24:\"Identificador do CAPTCHA\";'),('pt-br','messages:captcha-id-help','s:41:\"Este valor deve ser devolvido inalterado.\";'),('pt-br','messages:captcha-error','s:57:\"A verificação CAPTCHA falhou devido ao erro interno: $1\";'),('pt-br','messages:captcha-apihelp-param-captchaword','s:19:\"Resposta ao CAPTCHA\";'),('pt-br','messages:captcha-apihelp-param-captchaid','s:40:\"Identificador CAPTCHA do pedido anterior\";'),('pt-br','messages:confirmedit-preview-line','s:16:\"Número de linha\";'),('pt-br','messages:confirmedit-preview-content','s:9:\"Conteúdo\";'),('pt-br','messages:confirmedit-preview-validity','s:8:\"Validade\";'),('pt-br','messages:confirmedit-preview-valid','s:7:\"válido\";'),('pt-br','messages:confirmedit-preview-invalid','s:9:\"inválido\";'),('pt-br','messages:confirmedit-preview-description','s:596:\"A seguinte tabela mostra cada linha nesta página e se ela é um endereço IP válido, ou uma gama de endereços IP válida. Se a linha for um endereço IP válido, ou uma gama de endereços IP válida, o endereço ou gama serão dispensados (<i>white listed</i>) da verificação CAPTCHA, mas linhas inválidas serão ignoradas. Um exemplo de uma gama de endereços IP válidos é 69.208.0.0/16, que vai de 69.208.0.0 a 69.208.255.255. [https://www.mediawiki.org/wiki/Special:MyLanguage/Help:Range_blocks#Calculating_the_CIDR_suffix Mais informação] sobre o cálculo de gamas de endereços IP.\";'),('pt-br','messages:pdf-file-page-warning','s:176:\"O PDF é um formato complexo que pode expor algumas das suas informações privadas, em alguns casos. Certifique-se de configurar o seu visualizador de PDF de uma forma segura.\";'),('pt-br','messages:pdf-file-page-warning-header','s:30:\"Considerações de privacidade\";'),('pt-br','messages:pdf-file-page-warning-footer','s:103:\"Este problema não é específico para este tipo de ficheiro, mas uma questão geral com o formato PDF.\";'),('pt-br','messages:pdf-file-page-warning-info','s:31:\"Saiba mais sobre este problema.\";'),('pt-br','messages:sidebar','s:158:\"\n* navigation\n** mainpage|mainpage-description\n** recentchanges-url|recentchanges\n** randompage-url|randompage\n** helppage|help\n* SEARCH\n* TOOLBOX\n* LANGUAGES\";'),('pt-br','messages:pagecategorieslink','s:18:\"Special:Categories\";'),('pt-br','messages:category-header-numerals','s:7:\"$1–$2\";'),('pt-br','messages:sitetitle','s:1