ctor.css as opposed to {{ns:user}}:Foo/Vector.css.\";'),('en','messages:updated','s:9:\"(Updated)\";'),('en','messages:note','s:22:\"<strong>Note:</strong>\";'),('en','messages:previewnote','s:92:\"<strong>Remember that this is only a preview.</strong>\nYour changes have not yet been saved!\";'),('en','messages:continue-editing','s:18:\"Go to editing area\";'),('en','messages:previewconflict','s:102:\"This preview reflects the text in the upper text editing area as it will appear if you choose to save.\";'),('en','messages:session_fail_preview','s:321:\"Sorry! We could not process your edit due to a loss of session data.\n\nYou might have been logged out. <strong>Please verify that you\'re still logged in and try again</strong>.\nIf it still does not work, try [[Special:UserLogout|logging out]] and logging back in, and check that your browser allows cookies from this site.\";'),('en','messages:session_fail_preview_html','s:407:\"Sorry! We could not process your edit due to a loss of session data.\n\n<em>Because {{SITENAME}} has raw HTML enabled, the preview is hidden as a precaution against JavaScript attacks.</em>\n\n<strong>If this is a legitimate edit attempt, please try again.</strong>\nIf it still does not work, try [[Special:UserLogout|logging out]] and logging back in, and check that your browser allows cookies from this site.\";'),('en','messages:token_suffix_mismatch','s:270:\"<strong>Your edit has been rejected because your client mangled the punctuation characters in the edit token.</strong>\nThe edit has been rejected to prevent corruption of the page text.\nThis sometimes happens when you are using a buggy web-based anonymous proxy service.\";'),('en','messages:edit_form_incomplete','s:125:\"<strong>Some parts of the edit form did not reach the server; double-check that your edits are intact and try again.</strong>\";'),('en','messages:editing','s:10:\"Editing $1\";'),('en','messages:creating','s:11:\"Creating $1\";'),('en','messages:editingsection','s: