s the last parameter, or at least after the $1text parameter.\";'),('en','messages:apihelp-edit-example-edit','s:12:\"Edit a page.\";'),('en','messages:apihelp-edit-example-prepend','s:47:\"Prepend <kbd>_&#95;NOTOC_&#95;</kbd> to a page.\";'),('en','messages:apihelp-edit-example-undo','s:52:\"Undo revisions 13579 through 13585 with autosummary.\";'),('en','messages:apihelp-emailuser-description','s:13:\"Email a user.\";'),('en','messages:apihelp-emailuser-param-target','s:22:\"User to send email to.\";'),('en','messages:apihelp-emailuser-param-subject','s:15:\"Subject header.\";'),('en','messages:apihelp-emailuser-param-text','s:10:\"Mail body.\";'),('en','messages:apihelp-emailuser-param-ccme','s:31:\"Send a copy of this mail to me.\";'),('en','messages:apihelp-emailuser-example-email','s:76:\"Send an email to user <kbd>WikiSysop</kbd> with the text <kbd>Content</kbd>.\";'),('en','messages:apihelp-expandtemplates-description','s:38:\"Expands all templates within wikitext.\";'),('en','messages:apihelp-expandtemplates-param-title','s:14:\"Title of page.\";'),('en','messages:apihelp-expandtemplates-param-text','s:20:\"Wikitext to convert.\";'),('en','messages:apihelp-expandtemplates-param-revid','s:71:\"Revision ID, for <nowiki>{{REVISIONID}}</nowiki> and similar variables.\";'),('en','messages:apihelp-expandtemplates-param-prop','s:158:\"Which pieces of information to get.\n\nNote that if no values are selected, the result will contain the wikitext, but the output will be in a deprecated format.\";'),('en','messages:apihelp-expandtemplates-paramvalue-prop-wikitext','s:22:\"The expanded wikitext.\";'),('en','messages:apihelp-expandtemplates-paramvalue-prop-categories','s:84:\"Any categories present in the input that are not represented in the wikitext output.\";'),('en','messages:apihelp-expandtemplates-paramvalue-prop-properties','s:64:\"Page properties defined by expanded magic words in the wikitext.\";'),('en','messages:apihelp-expandtemplates-paramvalue-prop-volatile','s:82:\"Whether the output is volatile and should not be reused elsewhere within the page.\";'),('en','messages:apihelp-expandtemplates-paramvalue-prop-ttl','s:72:\"The maximum time after which caches of the result should be invalidated.\";'),('en','messages:apihelp-expandtemplates-paramvalue-prop-modules','s:203:\"Any ResourceLoader modules that parser functions have requested be added to the output. Either <kbd>jsconfigvars</kbd> or <kbd>encodedjsconfigvars</kbd> must be requested jointly with <kbd>modules</kbd>.\";'),('en','messages:apihelp-expandtemplates-paramvalue-prop-jsconfigvars','s:66:\"Gives the JavaScript configuration variables specific to the page.\";'),('en','messages:apihelp-expandtemplates-paramvalue-prop-encodedjsconfigvars','s:83:\"Gives the JavaScript configuration variables specific to the page as a JSON string.\";'),('en','messages:apihelp-expandtemplates-paramvalue-prop-parsetree','s:32:\"The XML parse tree of the input.\";'),('en','messages:apihelp-expandtemplates-param-includecomments','s:47:\"Whether to include HTML comments in the output.\";'),('en','messages:apihelp-expandtemplates-param-generatexml','s:55:\"Generate XML parse tree (replaced by $1prop=parsetree).\";'),('en','messages:apihelp-expandtemplates-example-simple','s:68:\"Expand the wikitext <kbd><nowiki>{{Project:Sandbox}}</nowiki></kbd>.\";'),('en','messages:apihelp-feedcontributions-description','s:34:\"Returns a user contributions feed.\";'),('en','messages:apihelp-feedcontributions-param-feedformat','s:23:\"The format of the feed.\";'),('en','messages:apihelp-feedcontributions-param-user','s:40:\"What users to get the contributions for.\";'),('en','messages:apihelp-feedcontributions-param-namespace','s:47:\"Which namespace to filter the contributions by.\";'),('en','messages:apihelp-feedcontributions-param-year','s:24:\"From year (and earlier).\";'),('en','messages:apihelp-feedcontributions-param-month','s:25:\"From month (and earlier).\";'),('en','messages:apihelp-feed