.\";'),('en','messages:apihelp-query+info-param-prop','s:35:\"Which additional properties to get:\";'),('en','messages:apihelp-query+info-paramvalue-prop-protection','s:39:\"List the protection level of each page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-talkid','s:52:\"The page ID of the talk page for each non-talk page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-watched','s:37:\"List the watched status of each page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-watchers','s:35:\"The number of watchers, if allowed.\";'),('en','messages:apihelp-query+info-paramvalue-prop-visitingwatchers','s:91:\"The number of watchers of each page who have visited recent edits to that page, if allowed.\";'),('en','messages:apihelp-query+info-paramvalue-prop-notificationtimestamp','s:50:\"The watchlist notification timestamp of each page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-subjectid','s:50:\"The page ID of the parent page for each talk page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-url','s:67:\"Gives a full URL, an edit URL, and the canonical URL for each page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-readable','s:36:\"Whether the user can read this page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-preload','s:47:\"Gives the text returned by EditFormPreloadText.\";'),('en','messages:apihelp-query+info-paramvalue-prop-displaytitle','s:63:\"Gives the manner in which the page title is actually displayed.\";'),('en','messages:apihelp-query+info-param-testactions','s:70:\"Test whether the current user can perform certain actions on the page.\";'),('en','messages:apihelp-query+info-param-token','s:70:\"Use [[Special:ApiHelp/query+tokens|action=query&meta=tokens]] instead.\";'),('en','messages:apihelp-query+info-example-simple','s:52:\"Get information about the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+info-example-protection','s:75:\"Get general and protection informati