l URL (cannot be used with <var>$1prop</var>).\";'),('en','messages:apihelp-query+langlinks-param-prop','s:63:\"Which additional properties to get for each interlanguage link:\";'),('en','messages:apihelp-query+langlinks-paramvalue-prop-url','s:18:\"Adds the full URL.\";'),('en','messages:apihelp-query+langlinks-paramvalue-prop-langname','s:104:\"Adds the localised language name (best effort). Use <var>$1inlanguagecode</var> to control the language.\";'),('en','messages:apihelp-query+langlinks-paramvalue-prop-autonym','s:30:\"Adds the native language name.\";'),('en','messages:apihelp-query+langlinks-param-lang','s:51:\"Only return language links with this language code.\";'),('en','messages:apihelp-query+langlinks-param-title','s:56:\"Link to search for. Must be used with <var>$1lang</var>.\";'),('en','messages:apihelp-query+langlinks-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+langlinks-param-inlanguagecode','s:43:\"Language code for localised language names.\";'),('en','messages:apihelp-query+langlinks-example-simple','s:59:\"Get interlanguage links from the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+links-description','s:39:\"Returns all links from the given pages.\";'),('en','messages:apihelp-query+links-param-namespace','s:36:\"Show links in these namespaces only.\";'),('en','messages:apihelp-query+links-param-limit','s:25:\"How many links to return.\";'),('en','messages:apihelp-query+links-param-titles','s:101:\"Only list links to these titles. Useful for checking whether a certain page links to a certain title.\";'),('en','messages:apihelp-query+links-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+links-example-simple','s:44:\"Get links from the page <kbd>Main Page</kbd>\";'),('en','messages:apihelp-query+links-example-generator','s:70:\"Get information about the link pages in the page <kbd>Main Page</kbd>.\";'),('en','messages:apihelp-query+links-example-name