\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-timestamp','s:37:\"Adds the timestamp for the log event.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-comment','s:34:\"Adds the comment of the log event.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-parsedcomment','s:41:\"Adds the parsed comment of the log event.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-details','s:45:\"Lists additional details about the log event.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-tags','s:29:\"Lists tags for the log event.\";'),('en','messages:apihelp-query+logevents-param-type','s:37:\"Filter log entries to only this type.\";'),('en','messages:apihelp-query+logevents-param-action','s:210:\"Filter log actions to only this action. Overrides <var>$1type</var>. In the list of possible values, values with the asterisk wildcard such as <kbd>action/*</kbd> can have different strings after the slash (/).\";'),('en','messages:apihelp-query+logevents-param-start','s:40:\"The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+logevents-param-end','s:33:\"The timestamp to end enumerating.\";'),('en','messages:apihelp-query+logevents-param-user','s:47:\"Filter entries to those made by the given user.\";'),('en','messages:apihelp-query+logevents-param-title','s:42:\"Filter entries to those related to a page.\";'),('en','messages:apihelp-query+logevents-param-namespace','s:47:\"Filter entries to those in the given namespace.\";'),('en','messages:apihelp-query+logevents-param-prefix','s:43:\"Filter entries that start with this prefix.\";'),('en','messages:apihelp-query+logevents-param-tag','s:45:\"Only list event entries tagged with this tag.\";'),('en','messages:apihelp-query+logevents-param-limit','s:39:\"How many total event entries to return.\";'),('en','messages:apihelp-query+logevents-example-simple','s:23:\"List recent log events.\";'),('en','messages:apihelp-query+pagepropnames-description','s:4