ásicos GIT ]]\n\n*[[Media: Padrao-Versionamento.pdf | Padrão de Versionamento de código]]\n\n*[[Media: Zend-framework2.pdf| Apostila ZendFramework ]]\n\n\n\n== Links Úteis ==\n\n\n*[https://www.github.com GIT HUB]\n\n*[http://projetos.alyssonvicuna.com.br KAMBOARD]','utf-8'),(29,'<strong>\'\'\'Bem Vindo a Wiki da Fábrica de Software do Uniprojeção!\'\'\'</strong>\n\n\nEsta Wiki tem como objetivo unificar os documentos e arquivos utilizados na fábrica.\n\n\n== Sobre o projeto ==\n\nO Sistema Inteligente de Gestão a Catequese disponibiliza a função de controlar um escola de formação de catequese, no sistema é possível controlar a frequência dos alunos, catequistas, catequizando e responsável pelo catequista. Assim tornando-se mais prático este trabalho na escola.\n\n\n\n== Documentos ==\n\n*Manual do Sistema\n\n*Documento de visão\n\n*MER\n\n*Resumo do projeto\n\n\n\n\n\n\n#REDIRECT [[Página principal]]','utf-8'),(30,'<strong>\'\'\'Bem Vindo a Wiki da Fábrica de Software do Uniprojeção!\'\'\'</strong>\n\n\nEsta Wiki tem como objetivo unificar os documentos e arquivos utilizados na fábrica.\n\n\n== Sobre o projeto ==\n\nO sistema da escola jurídica da Universidade Projeção dá a opção ao administrador a possibilidade de realizar cadastro de questões e disciplina, o sistema é utilizado para geração de provas a serem a aplicadas na Universidade. O usuário ( professor ) acessa o sistema, escolhe a disciplina e o sistema traz a opção de escolha das questões de modo aleatório e manual. Ao seguir esses passos a prova é gerada e o usuário ( professor ) realiza a impressão.\n\n\n\n== Documentos ==\n\n*Manual do Sistema\n\n*Documento de visão\n\n*MER\n\n*Resumo do projeto\n\n\n\n\n\n\n#REDIRECT [[Página principal]]','utf-8'),(31,'<strong>\'\'\'Bem Vindo a Wiki da Fábrica de Software do Uniprojeção!\'\'\'</strong>\n\n\nEsta Wiki tem como objetivo unificar os documentos e arquivos utilizados na fábrica.\n\n\n== \'\'\'Sobre o projeto\'\'\' ==\n\nO sistema da escola jurídica da Univ